INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('124', '1', 'Светящиеся Браслеты (LED)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nбраслеты (LED).&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сделаны из\r\nвысоко- качественного пластика, с встроенными LED источниками света для вечеринок, тусовок и просто посещения ночных клубов.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Размер\r\n22,5смх2смх15см&lt;/p&gt;Источники\r\nпитания: &amp;nbsp;1 элемент CR927+1 элемент *LR927', 'Светящиеся браслеты (LED)', 'Светящиеся браслеты|Другие клубные аксессуары|Распродажа', 'Светящиеся,браслеты, аксессуары,клубные,яркие');
