INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('80', '1', 'ВНЕШНИЕ АККУМУЛЯТОРЫ', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Как часто бывают ситуация, что батарея вашего телефона или планшета &quot;села&quot; в самый неподходящий момент?! &amp;nbsp;Мы предлагаем эффективное решение проблемы - внешние аккумуляторы.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Внешние аккумуляторы (Power bank) - устройства, позволяющие зарядить ваш телефон, а так же любое другое устройство, поддерживающее &amp;nbsp;сетевую зарядку. Внешние аккумуляторы отличаются по мощности, входному и выходному токам(чем выше ток, тем быстрее зарядка) и &amp;nbsp;материалу корпуса. При этом они достаточно компактны и имеют небольшой вес, что позволяет им умещаться в кармане или сумочке. Широкий выбор внешних аккумуляторов предлагает наш интернет магазин, разные модели из пластика и алюминия, более 10-ти расцветок, выбор емкостей от 2600mAh до внушительных 20 000mAh.&lt;/p&gt;', 'Внешние аккумуляторы', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('81', '1', 'МОНОПОДЫ', '&lt;p class=&quot;MsoNormal&quot;&gt;Монопод- оригинальное устройство для облегчения процесса\r\nсъёмки автопортретов ( «селфи»). Они появились сравнительно недавно. С\r\nсовершенствованием фото камер в мобильных телефонах, появилась возможность\r\nполучать достаточно качественные снимки для размещения их в первую очередь, в\r\nсоциальных сетях. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;Монопод представляет собой раздвижной штатив с ручным (\r\nпроводной) или автоматическим управлением (&lt;span lang=&quot;EN-US&quot;&gt;bluetooth &lt;/span&gt;технология) фото камерой мобильного телефона. На конце\r\nштатива размещена рамка для крепления телефона, как правило она настраивается\r\nпод любой размер аппарата.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;', 'Большой выбор моноподов', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('83', '1', 'КАБЕЛИ', '&lt;p&gt;Кабели для смартфона являются аксессуарами, которыми каждый из нас пользуется ежедневно. Как правило они не отличаются друг от друга ни цветом, ни дизайном.&lt;/p&gt;&lt;p&gt;Наш интернет-магазин исправляет этот недостаток. В нашем ассортименте более десятка оригинальных видов кабелей, в том числе и кабели с встроенными светодиодами, на все популярные модели смартфонов. Наличие разных цветов, позволит вам выбрать именно тот продукт, который будет удовлетворять всем вашим потребностям. Некоторые из них являются универсальными, то есть подходят к нескольким типам смартфонов одновременно. Эти модели актуальны для людей, которые используют два смартфона одновременно.&lt;/p&gt;&lt;p&gt;Все кабели проходят двойной контроль: первый: на производстве, второй: при поступлении в Россию.&lt;/p&gt;&lt;p&gt;Заходите в каталог и выбирайте кабели для себя или в подарок друзьям!&lt;/p&gt;', 'Кабели для смартфонов', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('84', '1', 'ОБЪЕКТИВЫ', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Внешние объективы&lt;/span&gt; - универсальные оптические устройства предназначенные для расширения возможностей штатных камер смартфонов, планшетов, ноутбуков. Различаются несколько видов внешних объективов: &amp;nbsp;1. Широкоугольные - позволяют значительно увеличить угол захвата. 2. Макро - позволяют использовать камеру, как увеличительное стекло 3. Создающие эффект &quot;Рыбий глаз&quot; 4. Создающие эффект сферы. В нашем магазине внешние объективы представлены, как по отдельности, так и в наборах по 2,3,4 объектива. &amp;nbsp;Прекрасно подойдут для оригинального и несомненно нужного подарка на все случаи жизни.&lt;/p&gt;', 'Подарочные флешки', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('82', '1', 'ЗАЩИТНЫЕ СТЕКЛА', '&lt;p&gt;С большим удовольствием, представляем Вам продукт, который защитит дисплей Вашего смартфона от повреждений и царапин и тем самым позволит сэкономить на его ремонте и замене, а так же позволит сохранять его, длительное время в первозданном виде.&lt;/p&gt;&lt;p&gt;Защитные стекла пришли на смену пластиковой пленке, которая до последнего времени использовалась для этих целей. Пленка имеет ряд недостатков: основной – она быстро покрывается царапинами и смартфон теряет свой внешний вид. Так же ее защитные свойства хуже, нежели у стекол.&lt;/p&gt;&lt;p&gt;Первые модели стекол были достаточно толстыми (до 1 мм) и в тоже время обладали более низкой сопротивляемостью к повреждениям, нежели современные модели. Сейчас их толщина составляет всего 0,33мм, наклейка такого стекла зрительно не увеличивает толщину смартфона.&lt;/p&gt;&lt;p&gt;Не так давно, начали производить ЗАКАЛЕННЫЕ стекла, что значительно повысило их износостойкость и прочность. Они практически не царапаются и в большинстве случаев предохраняют дисплей от повреждений, вызванных падением.&lt;/p&gt;&lt;p&gt;CEO Digital поставляет широкий ассортимент защитных стекол на многие популярные модели смартфонов от ведущих производителей Гонконга. Все они изготовлены из закаленного стекла, толщиной – 0,33 мм и имеют, так называемый эффект - 2,5D.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Существует три вида стекол:&lt;/p&gt;&lt;p&gt;- Обычные – прозрачные стекла с эффектом 2,5 D&lt;/p&gt;&lt;p&gt;- Тонированные - позволяют читать информацию с дисплея, только под определенным углом, то есть информацию на экране будете видеть только вы.&lt;/p&gt;&lt;p&gt;- Зеркальные: с ними в отключенном состоянии, Ваш дисплей превращается в зеркало.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Для Iphone 4 и 5, предлагаем наборы, т.е. защиту, как дисплея так и задней панели.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Вы можете, как самостоятельно наклеить стекло на дисплей (подробная инструкция есть на сайте), так и обратиться к нашему специалисту (наш оффлайн магазин расположен на 3-м этаже ТК «Комсомолл»).&lt;/p&gt;', 'Защитные стекла для дисплеев смартфонов и планшетов', '', '');
