INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('139', '1', 'ЗЕРКАЛЬНЫЕ ', '&lt;p&gt;Зеркальное, защитное &amp;nbsp;стекло помимо защитной функции, при отключенном дисплее смартфона, выполняет роль зеркала. Данная функция очень удобная и совершенно не влияет на качество отображения информации на смартфоне.&lt;/p&gt;', 'Зеркальные закаленные стекла', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('127', '1', 'Светящиеся Шнурки (LED)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nшнурки (LED)&lt;/i&gt;&lt;/b&gt;&lt;i&gt;.&lt;/i&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сделаны из\r\nспециального гибкого пластика, с встроенными лед источниками света и блоком\r\nуправления, закрепляемом на «язычке» обуви.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Длина: 80см&lt;/p&gt;Источники\r\nпитания – 2 элемента &lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;\r\n2032 («часовые» батарейки).', 'Светящиеся шнурки (LED)', 'Светящиеся шнурки|Распродажа|Доставка РФ ', 'Светящиеся шнурки, аксессуары, клубные');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('128', '1', 'ДЕТСКИЕ', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Детские LED футболки.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Обладают полным функционалом взрослых моделей. Сделают вашего ребенка, настоящей &quot;звездой&quot; любого детского праздника.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;/p&gt;', 'LED футболки детские - интернет-магазин CEO', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('130', '1', 'ДЕТСКИЕ', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;Бейсболка с встроенной &lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt; панелью&lt;/b&gt; – это отличный образец современной, клубной\r\nодежда.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панель\r\nфункционирует по принципу светового индикатора, эквалайзера, т.е. изображение\r\nпульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой\r\nдругой источник звука.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В такой\r\nодежде вы не останетесь, незамеченным ни в одной компании, ни на одной\r\nвечеринке.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;А если вы\r\nбудете использовать наши футболки с &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панелями и &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;аксессуарами,\r\nто восхищенное внимание окружающих, гарантировано.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Дизайн &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt; панели, предусматривает использование,\r\nкак одного &amp;nbsp;цвета, так и их комбинацию. Ассортимент\r\nпозволяет выбрать наиболее понравившийся цвет и изображение.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Мы\r\nиспользуем бейсболки глубокого, черного цвета, для достижения максимального\r\nрезультата.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания – элемент &lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;\r\n2032 («часовые» батарейки).&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В отличии от\r\nмоделей предыдущих поколений, где панель пришита к бейсболке, что исключает ее\r\nстирку, новая модель предусматривает компактный блок, который крепится, с\r\nпомощью застежек «липучка».&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;При стирке\r\nон легко отсоединяется и так же присоединяется.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панель\r\nпредставляет собой полноценное электронное устройство, которое помимо &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;дисплея,\r\nвключает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;Сама\r\nбейсболка изготовлена из высококачественного, 100% хлопка.', 'LED кепки, детские светящиеся кепки', '', '');
