INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('136', '1', 'КОМБИНИРОВАННЫЕ', '&lt;p&gt;Комбинированные кабели позволяют использовать их с двумя и более типами смартфонов. Например: Iphone 5 и MicroUSB&lt;/p&gt;', 'кабели - комбинированные', '', '');
