INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('147', '1', 'ПРИКОЛЬНЫЕ НАУШНИКИ', '&lt;p&gt;Наушники необычных форм- факторов от СЕО. Наушники &amp;nbsp;в виде замка-молнии - Zipper. Флуоресцентные наушники: в течении светового дня идет зарядка флуоресцентных элементов, а затем в темноте провода наушников светятся яркими цветами.&lt;/p&gt;&lt;p&gt;А так же ХИТ этого сезона наушники, светящиеся, со встроенными диодами. Мерцают в такт, играющей в наушниках музыки. Причем это видно и днем и ночью. Очень эффектно. Одной зарядки хватает на целый день эксплуатации. Будьте яркими с СЕО.&lt;/p&gt;', 'Наушники светящиеся ', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('60', '1', 'КЛУБНАЯ ОДЕЖДА', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Светящаяся одежда и аксессуары (LED) - это новинка в области клубной культуры. Специальные встроенные светодиодные устройства позволяют добиться мерцания в такт окружающей музыки (звукам).&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Именно поэтому их еще называют эквалайзерами. Низкое энергопотребление позволяет достигать длительного времени работы. Питание устройств от батареек ААА (мизинцы) или LR 20 (шайбы).&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Спешите на распродажу одежды и аксессуаров. Цены начинаются от 290 рублей.&lt;/p&gt;', 'Светящаяся клубная одежда', 'Светящаяся одежда|Аксессуары|От 290р|Широкий выбор|Распродажа', 'Светящаяся,одежда,футболка,бейсболка,аксессуары');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('65', '1', 'СВЕТЯЩАЯСЯ ФУТБОЛКА (LED)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Светящаяся футболка-эквалайзер (&lt;span lang=&quot;EN-US&quot;&gt;LED),&lt;/span&gt;&amp;nbsp;ВТОРОГО поколения – это отличный образец современной, клубной одежды.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Светящаяся LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник. Светодиоды дают очень яркие и ровные цвета.&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Футболка-эквалайзер изготовлена из высококачественного трикотажа, содержащего – 100% хлопка, по европейским лекалам.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;Мы используем футболки глубокого, черного цвета, для достижения максимального результата.&lt;/span&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp;Специальная система конструкции воротника предотвращает его преждевременное растягивание. Плотность ткани составляет – 180 г/кв.м., что позволяет использовать футболку ее на протяжении длительного времени без ущерба для внешнего вида.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Источники питания – три элемента ААА («мизинчиковые» батарейки).&lt;/span&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&amp;nbsp;&lt;span style=&quot;font-size: 12px;&quot;&gt;А если вы будете использовать комплект из светящихся футболки, бейсболки а так же &amp;nbsp;аксессуаров&lt;/span&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;, то восхищенное внимание окружающих - гарантировано. Выберите свой &quot;принт&quot; из более, чем 30-ти изображений.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;span style=&quot;color: rgb(255, 0, 0); font-size: 12px; font-weight: bold;&quot;&gt;Отличительные особенности моделей второго поколения светящихся футболок-эквалайзеров:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;1. Легко монтируется и снимается при помощи крепления &quot;липучка&quot;. Подлежит стирке.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;2. Не имеет проводов и отдельных блоков питания и управления&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;3. Светодиоды на 25% ярче, чем используемые в изделиях первого поколения.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;Светящаяся LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель представляет собой полноценное электронное устройство, которое помимо&amp;nbsp;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;', 'Светящаяся футболка-эквалайзер', 'Светящаяся футболка|Распродажа|От 990р|Доставка РФ|', 'Светящаяся,футболка,эквалайзер,одежда,клубная,распродажа');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('63', '1', 'АКСЕССУАРЫ', '&lt;p&gt;В этом разделе представлен широкий ассортимент аксессуаров для мобильных телефонов (смартфонов). USB кабели, зарядные устройства для всех типов современных &amp;nbsp;телефонов, селфи палки, светящиеся и флуоресцентные наушники, внешние аккумуляторы, защитные закаленные стекла для экранов смартфона, внешние объективы, заглушки и накладки на навигационные клавиши. Высокое качество при вполне приемлемых ценах, вот наш девиз. Только у нас светящиеся наушники от 990 рублей. Флуоресцентные от 790 рублей. Постоянные акции и распродажи.&lt;/p&gt;', 'Мобильные аксессуары', 'USB Кабели|Зарядки|Светящиеся наушники|Селфи|Защитные стекла|Качество|Лучшая цена', 'Светящиеся наушники,USB,кабели,зарядки,защитные стекла,внешние аккумуляторы,селфи,палки');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('66', '1', ' СВЕТЯЩАЯСЯ БЕЙСБОЛКА (LED)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;Светящаяся бейсболка с встроенной &lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt; панелью&lt;/b&gt; – это отличный образец современной, клубной\r\nодежды.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;Светящаяся &lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель\r\nфункционирует по принципу светового индикатора, эквалайзера, т.е. изображение\r\nпульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой\r\nдругой источник звука.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В такой\r\nодежде вы не останетесь, незамеченным ни в одной компании, ни на одной\r\nвечеринке.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;А если вы\r\nбудете использовать наши светящиеся футболки (&lt;span lang=&quot;EN-US&quot;&gt;LED)&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;с&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;аксессуарами,\r\nто восхищенное внимание окружающих, гарантировано.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Дизайн &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt; панели, предусматривает использование,\r\nкак одного &amp;nbsp;цвета, так и их комбинацию. Ассортимент\r\nпозволяет выбрать наиболее понравившийся цвет и изображение.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Мы\r\nиспользуем бейсболки глубокого, черного цвета, для достижения максимального\r\nрезультата.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания – элемент &lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;\r\n2032 («часовые» батарейки).&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В отличии от\r\nмоделей предыдущих поколений, где светящаяся панель пришита к бейсболке, что исключает ее\r\nстирку, новая модель предусматривает компактный блок, который крепится, с\r\nпомощью застежек «липучка».&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;При стирке\r\nон легко отсоединяется.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&amp;nbsp;Светящаяся&amp;nbsp;&lt;/o:p&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель (LED) представляет собой полноценное электронное устройство, которое помимо &lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;дисплея,\r\nвключает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сама\r\nбейсболка изготовлена из высококачественного, 100% хлопка.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;', 'Светящаяся бейсболка клубная ', 'Светящиеся бейсболки|Акция|От 990рублей|Доставка РФ', 'Светящаяся,клубная,бейсболка,яркая');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('131', '1', 'ВЗРОСЛЫЕ', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;Бейсболка с встроенной &lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt; панелью&lt;/b&gt; – это отличный образец современной, клубной\r\nодежды.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панель\r\nфункционирует по принципу светового индикатора, эквалайзера, т.е. изображение\r\nпульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой\r\nдругой источник звука.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В такой\r\nодежде вы не останетесь, незамеченным ни в одной компании, ни на одной\r\nвечеринке.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;А если вы\r\nбудете использовать наши футболки с &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панелями и &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;аксессуарами,\r\nто восхищенное внимание окружающих, гарантировано.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Дизайн &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt; панели, предусматривает использование,\r\nкак одного &amp;nbsp;цвета, так и их комбинацию. Ассортимент\r\nпозволяет выбрать наиболее понравившийся цвет и изображение.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Мы\r\nиспользуем бейсболки глубокого, черного цвета, для достижения максимального\r\nрезультата.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания – элемент &lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;\r\n2032 («часовые» батарейки).&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В отличии от\r\nмоделей предыдущих поколений, где панель пришита к бейсболке, что исключает ее\r\nстирку, новая модель предусматривает компактный блок, который крепится, с\r\nпомощью застежек «липучка».&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;При стирке\r\nон легко отсоединяется и так же присоединяется.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панель\r\nпредставляет собой полноценное электронное устройство, которое помимо &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;дисплея,\r\nвключает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сама\r\nбейсболка изготовлена из высококачественного, 100% хлопка.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;', 'LED кепки, взрослые светящиеся кепки -CEO', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('59', '1', 'НАНЕСЕНИЕ СТРАЗ', '&lt;p style=&quot;margin-bottom: 0.11in; font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;&lt;b style=&quot;color: rgb(0, 0, 255);&quot;&gt;«СТРАЗЫ»&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0.11in; font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Наши аппликации создаются с использованием страз. Стразы из стекла или алюминия. &amp;nbsp;Коллекция состоит из более чем ста изображений и их количество постоянно растет. Аппликации из страз производятся вручную (для достижения максимально высокого качества изделий) в Гонконге&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;). Наш поставщик отправляет свою продукцию клиентам из Америки и Европы, Африки и Азии. Ассортимент&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 255);&quot;&gt;&lt;b&gt;CEOSTORE.&lt;/b&gt;&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;&lt;b&gt;RU&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&amp;nbsp;включает в себя, композиции со стразами, как для взрослых, так и для детей. При дневном свете изображение переливается, что очень эффектно.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0.11in;&quot;&gt;&lt;b style=&quot;color: rgb(0, 0, 255);&quot;&gt;«НАША ОДЕЖДА ДЛЯ НАНЕСЕНИЯ СТРАЗ»&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0.11in;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Вы можете самостоятельно выбрать модель, цвет и размер футболки или толстовки без рисунка, для нанесения аппликации. Наша одежда производится из высококачественн&lt;wbr&gt;ого трикотажа «пенье» (класс «премиум»), по европейским лекалам. Состав такни: 92% хлопка и 8% лайкры. Она мягкая для кожи и благодаря добавлению лайкры, имеет чуть заметный блеск. В воротнике используется прошивка тесьмой, что препятствует его вытягиванию. Плотность, ткани - 230 г/кв.м., что выгодно отличает наши модели от представленных на российском рынке изделий и позволяет значительно увеличить срок их использования.&lt;/p&gt;&lt;p style=&quot;font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0.11in;&quot;&gt;&lt;b style=&quot;color: rgb(0, 0, 255);&quot;&gt;«ПРОЦЕСС НАНЕСЕНИЯ СТРАЗ&quot;&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0.11in;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Нанесение аппликаций на футболки производится при помощи специализированн&lt;wbr&gt;ого, гидравлического термо-пресса. Усилие до 350кг и температура до 300 градусов, дает возможность качественно нанести аппликацию, что позволит использовать ее на протяжении длительного времени, не боясь выпадения страз. Весь процесс нанесения занимает не более 20-25-ти минут.&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 255); background-color: rgb(255, 255, 255);&quot;&gt;&lt;b&gt;Если вы хотите увидеть данный процесс «вживую», приезжайте в наш офф-лайн магазин &quot;СЕО&quot; в ТРК «Комсомолл», 3-й этаж. &amp;nbsp;Телефон&lt;/b&gt;&lt;b&gt;: &amp;nbsp;&lt;gisphone class=&quot;_gis-phone-highlight-wrap js_gis-phone-highlight-wrap-c349764dcfed5648880a01f20ae5f837 _gis-phone-highlight-phone-wrap&quot; data-ph-parsed=&quot;true&quot;&gt;287-00-44&lt;/gisphone&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;br&gt;&lt;/p&gt;', 'Стразы одежда', 'Футболки со стразами|Готовые|На заказ|Акция|От 790рублей', 'Стразы,футболка,одежда,аппликации');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('67', '1', 'CВЕТЯЩИЕСЯ АКСЕССУАРЫ (LED)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;Светящиеся&amp;nbsp;&lt;/span&gt; аксессуары – это отличное\r\nдополнение к нашим футболкам и бейсболкам с &lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;, а так же&amp;nbsp;\r\nоригинальные&amp;nbsp; украшения, которые\r\nпомогут вам выглядеть оригинально. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Встроенные\r\nсветодиоды используют несколько режимов: непрерывное свечение и&amp;nbsp; разно- частотное мерцание.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nочки. &lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сделаны из пластика,\r\nс встроенными лед источниками света. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Размер\r\n15см х 7см х 14см&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания – 3 элемента &lt;span lang=&quot;EN-US&quot;&gt;AG&lt;/span&gt;\r\n13&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nбраслеты.&lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сделаны из\r\nвысококачественного пластика, с встроенными лед источниками света.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Размер\r\n22,5см х 2см х 15см&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания: &amp;nbsp;1 элемент CR927+1 элемент *LR927&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nшнурки&lt;/i&gt;&lt;/b&gt;&lt;i&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сделаны из\r\nспециального гибкого пластика, с встроенными лед источниками света и блоком\r\nуправления, закрепляемом на «язычке» обуви.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Длина: 80см&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания – 2 элемента &lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;\r\n2032 («часовые» батарейки).&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nсережки.&lt;o:p&gt;&lt;/o:p&gt;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Изготовлены\r\nиз высококачественной стали, с встроенными лед источниками света.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Цвет:\r\nсеребряный.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Размер:\r\n0,7см х2,1см&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания: &amp;nbsp;1 элемент &lt;span lang=&quot;EN-US&quot;&gt;LR 521&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;Светящиеся шнурки,браслеты и очки не оставят вас незамеченными на любой вечеринке или тусовке.&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', 'Светящиеся украшения и аксессуары', 'Светящиеся шнурки,браслеты,очки|Акция |От 290рублей|Доставка РФ', 'Светящиеся,браслеты,очки,шнурки,сережки');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('126', '1', 'Светящиеся Сережки (LED)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nсережки.&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Изготовлены\r\nиз высококачественной стали, с встроенными LED источниками света.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Цвет:\r\nсеребряный.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Размер:\r\n0,7см х2,1см&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;Источники\r\nпитания (LED): &amp;nbsp;1 элемент &lt;span lang=&quot;EN-US&quot;&gt;LR 521&lt;/span&gt;', 'Светящиеся сережки', 'Светящиеся сережки|Необычный аксессуар|Акция|Доставка', 'Светящиеся,сережки,клубные, аксессуары');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('143', '1', 'КНОПКИ. ЗАГЛУШКИ', '&lt;p&gt;Небольшие, но яркие аксессуары - оригинальные накладки на кнопки &quot;Домой&quot; для смартфонов Apple и Samsung, придадут вашему устройству оригинальность.&lt;/p&gt;&lt;p&gt;Накладки необходимы, также при установке защитных стекол, для создания ровной поверхности передней панели. &lt;/p&gt;&lt;p&gt;Заглушки - забавные фигурки, которые &amp;nbsp;вставляются в входное отверстие аудиоразъема.&amp;nbsp;&lt;/p&gt;', 'Кнопки - домой', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('144', '1', 'КНОПКИ &quot;ДОМОЙ&quot;', '&lt;p style=&quot;font-size: 11.9999990463257px;&quot;&gt;Небольшие, но яркие аксессуары - оригинальные накладки на кнопки &quot;Домой&quot; для смартфонов Apple и Samsung, придадут вашему устройству оригинальность.&lt;/p&gt;&lt;p style=&quot;font-size: 11.9999990463257px;&quot;&gt;Накладки необходимы, также при установке защитных стекол, для создания ровной поверхности передней панели.&lt;/p&gt;', 'кнопки - домой', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('145', '1', 'ЗАГЛУШКИ АУДИОРАЗЪЕМА', '&lt;p&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;Заглушки - забавные фигурки, которые &amp;nbsp;вставляются в входное отверстие аудиоразъема.&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'заглушки - аудиоразъема', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('125', '1', 'Светящиеся Очки (LED)', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;b&gt;&lt;i&gt;Светящиеся\r\nочки (LED). &lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сделаны из пластика,\r\nс встроенными лед источниками света. &lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Доступен\r\nрежим непрерывного свечения и мерцания.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Размер\r\n15смх7смх14см&lt;/p&gt;Источники\r\nпитания для LED &amp;nbsp;– 3 элемента &lt;span lang=&quot;EN-US&quot;&gt;AG&lt;/span&gt;\r\n13', 'Светящиеся очки', 'Светящиеся очки|Мега- аксессуар|Акция|Доставка ', 'Светящиеся, очки, аксессуары,клубные');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('129', '1', 'ВЗРОСЛЫЕ', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Футболки &amp;nbsp;с встроенной&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&amp;nbsp;панелью ВТОРОГО поколения – это отличный образец современной, клубной одежды.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник. Светодиоды дают очень яркие и ровные цвета.&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; Футболка изготовлена из высококачественного трикотажа, содержащего – 100% хлопка, по европейским лекалам.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;Мы используем футболки глубокого, черного цвета, для достижения максимального результата.&lt;/span&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp;Специальная система конструкции воротника предотвращает его преждевременное растягивание. Плотность ткани составляет – 180 г/кв.м., что позволяет использовать футболку ее на протяжении длительного времени без ущерба для внешнего вида.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;Источники питания – три элемента ААА («мизинчиковые» батарейки).&lt;/span&gt;&lt;span style=&quot;font-size: 11.9999990463257px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&amp;nbsp;&lt;span style=&quot;font-size: 12px;&quot;&gt;А если вы будете использовать комплект из футболки, бейсболки а так же LED аксессуаров&lt;/span&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;, то восхищенное внимание окружающих - гарантировано. Выберите свой &quot;принт&quot; из более, чем 30-ти изображений.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;span style=&quot;color: rgb(255, 0, 0); font-size: 12px; font-weight: bold;&quot;&gt;Отличительные особенности моделей второго поколения:&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;1. Легко монтируется и снимается при помощи крепления &quot;липучка&quot;. Подлежит стирке.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;2. Не имеет проводов и отдельных блоков питания и управления&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;3. Светодиоды на 25% ярче, чем используемые в изделиях первого поколения.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 11.9999990463257px;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель представляет собой полноценное электронное устройство, которое помимо&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;/p&gt;', 'LED футболки для взрослых - CEO', '', '');
