INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('3', '1', 'Способы оплаты', '&lt;h3 style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Оплата банковскими картами&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;Вы&amp;nbsp;можете оплатить заказ, используя банковскую карту Visa или Mastercard. Выберите способ оплаты: «Банковские карты», и&amp;nbsp;вы&amp;nbsp;будете перенаправлены на&amp;nbsp;сайт www.ucs.su. Далее&amp;nbsp;следуйте инструкциям.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;Для осуществления платежа Вам потребуется сообщить данные Вашей пластиковой карты. Передача этих сведений производится с&amp;nbsp;соблюдением всех необходимых мер безопасности. Данные будут сообщены только на&amp;nbsp;авторизационный сервер Банка по&amp;nbsp;защищенному каналу (протокол SSL 3.0). Информация передается в&amp;nbsp;зашифрованном виде и&amp;nbsp;сохраняется только на&amp;nbsp;специализированном сервере платежной системы.&lt;/p&gt;&lt;h3 style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Яндекс.Деньги&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;&lt;a style=&quot;color: rgb(0, 174, 239);&quot; href=&quot;http://money.yandex.ru/&quot; target=&quot;_blank&quot;&gt;Яндекс.Деньги&lt;/a&gt;&amp;nbsp;— доступный и&amp;nbsp;безопасный способ платить за&amp;nbsp;товары и&amp;nbsp;услуги через интернет. Пополнение счета и&amp;nbsp;оплата заказов происходят в&amp;nbsp;реальном времени на&amp;nbsp;&lt;a style=&quot;color: rgb(0, 174, 239);&quot; href=&quot;http://money.yandex.ru/&quot; target=&quot;_blank&quot;&gt;сайте платежной системы&lt;/a&gt;. Для перевода средств на&amp;nbsp;наш электронный кошелек необходимо иметь собственный счет в&amp;nbsp;системе «Яндекс.Деньги» и&amp;nbsp;достаточную для перевода сумму.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;Для этого выберите способ оплаты: «Яндекс.Деньги», вы&amp;nbsp;будете перенаправлены на&amp;nbsp;сайт сервиса ROBOKASSA. Далее следуйте инструкциям.&lt;/p&gt;&lt;h3 style=&quot;font-family: Arial, Helvetica, sans-serif; line-height: 20px; color: rgb(51, 51, 51); margin-bottom: 10px; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Оплата при получении (действует в пределах г. Красноярска)&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;Вы&amp;nbsp;можете оплатить Ваш заказ наличными курьеру, при получении. &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;h3 style=&quot;margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 20px;&quot;&gt;&amp;nbsp;&lt;br&gt;&lt;/h3&gt;', 'Способы оплаты - СЕО', '', '');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('6', '1', 'Доставка', '&lt;h4&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 0);&quot;&gt;УСЛОВИЯ ПОКУПКИ И ДОСТАВКИ:&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; Оформить заказ Вы можете в любое удобное для Вас время без выходных, праздников и перерывов на обед в нашем интернет - магазине с помощью корзины покупателя.&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;После оформления заказа мы свяжемся с Вами и согласуем удобное для Вас время доставки. Доставка осуществляется только после предварительного согласования по телефону. &amp;nbsp;В течение &amp;nbsp;1-2х. дней (после согласования). Время доставки с 09:00 до 21:00. Осуществляется автотранспортом и зависит от дорожной обстановки и удаления адреса доставки.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 255);&quot;&gt;САМОВЫВОЗ:&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;Вы можете забрать Ваш заказ в нашей оффлайновой точке в ТРК &quot;Комсомолл&quot; в часы ее работы с 10.00 до 22.00 без выходных.&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 255);&quot;&gt;ДОСТАВКА ПО &amp;nbsp;КРАСНОЯРСКУ:&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;При заказе на сумму менее 1000 рублей - стоимость-150 рублей&lt;/p&gt;&lt;p&gt;При заказе свыше 1500 рублей (с учётом скидок) - БЕСПЛАТНО!&lt;/p&gt;&lt;p&gt;Стоимость доставки в удаленные районы г. Красноярска согласовывается с менеджером.&lt;/p&gt;&lt;p&gt;При заказе свыше 3000 рублей (с учетом скидок) - доставки в удаленные районы города &amp;nbsp;осуществляется БЕСПЛАТНО!&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &lt;span style=&quot;font-family: \'Times New Roman\';&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;Претензии по внешнему виду доставленного Вам товара, в соответствии со ст. 458 и 459 ГК РФ, Вы можете предъявить только до передачи Вам товара продавцом, а потому рекомендуем Вам внимательно осматривать товар при получении. Вам необходимо удостовериться, что заказ доставлен Вам в полном объеме, проверить внешний вид, комплектность. Возврат товара осуществляется если товар не надлежащего качества. В случае, &amp;nbsp;если Вы отказываетесь от товара, стоимость доставки должна быть оплачена курьеру (пункт 4 статьи 497 Гражданского Кодекса Российской Федерации). &lt;/span&gt;&amp;nbsp;&lt;/p&gt;&lt;h4&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 255);&quot;&gt;ДОСТАВКА ПО РФ:&lt;/span&gt;&lt;/h4&gt;&lt;h4&gt;&lt;span style=&quot;font-size: 12px; line-height: 18px;&quot;&gt;&amp;nbsp;Доставка в любые &amp;nbsp;города РФ почтой России или федеральной компанией экспресс доставки &quot;СДЭК&quot;. &amp;nbsp;Доставка в течение 7-9 дней.&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Доставка', '', '');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('7', '1', 'Как создать товар в конструкторе?', '&lt;p&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;В данном разделе вы можете создать дизайн вашей будущей футболки, с помощью конструктора&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt; Вначале выберите тип (мужская, женская, детская), вид (классическая, приталенная, с длинным рукавом, майка) и цвет футболки из каталога базовой одежды.&lt;br&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;img src=&quot;/image/catalog/help1.png&quot;&gt;&lt;br&gt;&lt;p&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;Затем используйте банк аппликаций для создания своего дизайна. Выбирайте тип аппликаций (алюминиевые или стеклянные). &lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;&lt;img src=&quot;/image/catalog/help2.png&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;После окончательного выбора, подтвердите Ваш заказ. &lt;/p&gt;\r\n\r\n\r\n&lt;p&gt;&lt;br&gt;&lt;img src=&quot;/image/catalog/help3.png&quot;&gt;&lt;/p&gt;', 'Как создать товар в конструкторе?', '', '');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('8', '1', '     СТРАЗЫ НА ФУТБОЛКАХ. ОПИСАНИЕ ТЕХНОЛОГИИ НАНЕСЕНИЯ.', '&lt;h1 style=&quot;margin: 0cm 0cm 6.4pt; font-family: \'Open Sans\', sans-serif; color: rgb(102, 102, 102); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;text-align: justify; color: rgb(0, 0, 255); font-family: \'Times New Roman\';&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; СТРАЗЫ ИЗ АЛЮМИНИЯ И СТЕКЛА. РУЧНАЯ РАБОТА&lt;/span&gt;&lt;/h1&gt;&lt;h4 style=&quot;font-family: \'Open Sans\', sans-serif; color: rgb(102, 102, 102); margin: 0cm 0cm 0.0001pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;line-height: 1.4; font-size: 9pt; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&amp;nbsp;&amp;nbsp; Аппликации из страз, представленные на нашем сайте, состоят из двух видов материалов: разноцветных (однотонных) алюминиевых пластинок и разноцветных (однотонных) стеклянных кристаллов. При ярком солнечном или дневном свете, аппликации создают очень интересный оптический эффект («перелив»). &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Одежда с таким эффектом смотрится очень интересно и главное необычно. &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Банк оригинальных аппликаций, на сегодняшний день, состоит из более чем ста изображений из страз и их количество постоянно растет. Аппликации производятся вручную (для достижения максимально высокого качества изделий) в Гонконге, на одном из крупнейших предприятий в данной отрасли. Наш поставщик отправляет своюпродукцию клиентам из США и Европы, Африки и Азии. Каталог аппликаций включает в себя, композиции, как для взрослых – преимущественно в стиле (&lt;span lang=&quot;EN-US&quot;&gt;unisex&lt;/span&gt;), так и для детей. Цены готовых футболок со стразами от 740 рублей.&lt;/h4&gt;&lt;h4 style=&quot;font-family: \'Open Sans\', sans-serif; color: rgb(102, 102, 102); margin: 0cm 0cm 0.0001pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 12px; line-height: 18px; text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(0, 112, 192);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h4&gt;&lt;h4 style=&quot;font-family: \'Open Sans\', sans-serif; color: rgb(102, 102, 102); margin: 0cm 0cm 0.0001pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 12px; line-height: 18px; text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(0, 112, 192);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(255, 255, 255); font-weight: bold; background-color: rgb(255, 0, 0);&quot;&gt;&lt;span style=&quot;text-align: center;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;text-align: center;&quot;&gt;ДЛЯ ТОГО ЧТО БЫ ПОПАСТЬ В ДИЗАЙН-КОНСТРУКТОР НАЖМИТЕ КНОПКУ ВВЕРХУ СТРАНИЦЫ&lt;/span&gt;&lt;/span&gt;&lt;/h4&gt;&lt;h1 style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;text-align: justify; color: rgb(0, 0, 255); font-family: \'Times New Roman\';&quot;&gt;&amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/h1&gt;&lt;h1 style=&quot;margin: 0cm 0cm 6.4pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 255); font-family: \'Times New Roman\';&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;НАНЕСЕНИЕ СТРАЗ&lt;/span&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;line-height: 13.5pt; color: inherit; text-align: justify; font-size: 9pt; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/h1&gt;&lt;h4 style=&quot;&quot;&gt;&lt;span style=&quot;line-height: 1.2; font-size: 9pt; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Arial; line-height: 1.2; font-size: 9pt;&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: Arial; line-height: 1.2; font-size: 9pt;&quot;&gt;&amp;nbsp;&lt;/span&gt; На нашем сайте вы выбираете базовые модели одежды для нанесения, затем аппликации из страз. После чего в специальном разделе нашего сайте - дизайн-конструкторе создаете вашу &amp;nbsp;модель, перебирая различные модели фасонов и цветов. На специальном оборудовании, сочетая высокую температуру около 200 градусов и давление более 100 кг, мы запечатаем стразы в ткань футболки и вы получаете действительно оригинальную и красивую вещь. Данное оборудование используется для промышленного производства изделий со стразами. Готовые изделия со стразами вы можете увидеть в галерее, в нижней части страницы.&lt;/h4&gt;&lt;h4 style=&quot;&quot;&gt;&lt;span style=&quot;font-family: Arial, sans-serif; font-size: 9pt; line-height: 13.5pt; text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(0, 112, 192);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(255, 255, 255); font-weight: bold;&quot;&gt; &amp;nbsp; &amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(255, 255, 255); font-weight: bold;&quot;&gt;&lt;span style=&quot;line-height: 1.1; text-align: center; background-color: rgb(255, 0, 0);&quot;&gt;ДЛЯ ТОГО ЧТО БЫ ПОПАСТЬ В ДИЗАЙН-КОНСТРУКТОР НАЖМИТЕ&amp;nbsp;КНОПКУ ВВЕРХУ СТРАНИЦЫ&lt;/span&gt;&lt;/span&gt;&lt;/h4&gt;&lt;h4 style=&quot;margin: 0cm 0cm 0.0001pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(255, 0, 0); font-weight: bold;&quot;&gt;&lt;span style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h4&gt;&lt;h1 style=&quot;margin: 0cm 0cm 6.4pt; font-family: \'Open Sans\', sans-serif; color: rgb(102, 102, 102); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;text-align: justify; color: rgb(0, 0, 255); font-family: \'Times New Roman\';&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;ОДЕЖДА ИЗ ТРИКОТАЖА &quot;ПЕНЬЕ&quot; (ПРЕМИУМ)&lt;/span&gt;&lt;/h1&gt;&lt;h4 style=&quot;margin: 0cm 0cm 0.0001pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;span style=&quot;line-height: 1.4; font-size: 9pt; font-family: Arial, sans-serif;&quot;&gt;&amp;nbsp;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;/span&gt;В дизайн-конструкторе, Вы можете выбрать модель, цвет и размер футболки или толстовки без рисунка, для нанесения аппликации. Вся одежда производится по нашему заказу, на одном из крупнейших, швейных производств в г. Иваново из высоко- качественн&lt;wbr&gt;ого трикотажа «пенье» (класс «премиум»), по европейским лекалам. Состав такни: 92%хлопка и 8% лайкры. Она мягкая для кожи и благодаря добавлению лайкры, имеет чуть заметный блеск. В воротнике используется прошивка тесьмой, что препятствующего вытягиванию. Плотность, ткани - 230 г/кв.м. При такой плотности ткань не «садится»и носится гораздо больше, нежели футболки 150-180 г/кв.м, которые в основном представлены на рынке.&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Мы предлагаем следующие модели для взрослых: классические, приталенные, с длинным рукавом, майки-боксерки, &amp;nbsp;для детей: классические модели. Используется четыре наиболее популярных цвета: ярко белый, серый меланж, глубокий черный, синий(джинс), наиболее сочетаемых со стразами.&lt;/h4&gt;&lt;h4 style=&quot;margin: 0cm 0cm 0.0001pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;&quot;&gt;&lt;br&gt;&lt;/h4&gt;&lt;h4 style=&quot;text-align: center; &quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(255, 255, 255); font-weight: bold;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;/span&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(255, 0, 0); font-weight: bold;&quot;&gt;МАСТЕРСКАЯ-БУТИК НАХОДИТСЯ В ТРК &quot;КОМСОМОЛЛ&quot; (3 ЭТАЖ)&lt;/span&gt;&lt;span style=&quot;line-height: 24px;&quot;&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(255, 0, 0); font-weight: bold;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;line-height: 24px; color: rgb(255, 0, 0);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/h4&gt;', 'Стразы нанесение', 'Футболки со стразами|Готовые|На заказ|Акция|От 790р', 'Стразы,футболки,одежда,дизайнерская,');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('4', '1', 'ОПТ', '&lt;h4&gt;&lt;span style=&quot;font-family: Arial; color: rgb(0, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Компания СЕО &lt;/span&gt;предлагает совместный бизнес &amp;nbsp;нашим &amp;nbsp;потенциальным партнерам по трем основным направлениям:&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 0);&quot;&gt;1. Одежда со стразами&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Мы приглашаем к сотрудничеству любые торговые компании, которые имеют в своем ассортименте одежду и готовы получать дополнительный доход за счет продажи эксклюзивных позиций по выгодным ценам.&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 0);&quot;&gt;2. Клубная одежда и аксессуары с LED&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Наши потенциальные клиенты - ночные клубы, продавцы оригинальной одежды и &amp;nbsp;аксессуаров для молодежи&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold; color: rgb(0, 0, 0);&quot;&gt;3. Аксессуары для смартфонов&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Мы приглашаем к сотрудничеству отделы по продаже аксессуаров для смартфонов, мастерские по ремонту мелкой электроники, любые другие торговые точки, заинтересованные в увеличении оборота и прибыли за счет высоко- маржинальных продуктов с хорошей оборачиваемостью.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Возможны поставки крупных партий товаров из Гонконга и Китая по минимальным ценам.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Готовы рассмотреть любые другие способы сотрудничества.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Телефон:&lt;/span&gt; &lt;span style=&quot;color: rgb(0, 0, 255);&quot;&gt;+7 (391) 294-00-14&lt;/span&gt;, &amp;nbsp;&lt;span style=&quot;font-weight: bold;&quot;&gt;Электронная почта: &lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 255); text-decoration: underline;&quot;&gt;opt@ceostore.net&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Опт моноподы', '', '');
