style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Источники питания – три элемента ААА («мизинчиковые» батарейки).&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;В отличии от моделей предыдущих поколений, где светящаяся &amp;nbsp;панель пришита к футболке, что исключает ее стирку. Блок управления, требует отдельного размещения и провода, для соединения с экраном, новая модель предусматривает единый с панелью, компактный блок, который крепится на уровне груди, с помощью застежек «липучка».&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;При стирке он легко отсоединяется и так же крепится.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;LED панель (эквалайзер) представляет собой полноценное электронное устройство, которое помимо &amp;nbsp;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Сама святящаяся футболка изготовлена из высококачественного трикотажа, содержащего – 100% хлопка, по европейским лекалам. Специальная система конструкции воротника предотвращает его преждевременное растягивание. Плотность ткани составляет – 180 г/кв.м., что позволяет использовать &amp;nbsp;ее на протяжении длительного времени без ущерба для внешнего вида.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Святящаяся футболка - выделись из толпы.&lt;/span&gt;&lt;/p&gt;', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер', 'Светящаяся   футболка эквалайзер LED - рентген', 'Светящиеся футболки и бейсболки| Акция| 990 рублей', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('74', '1', 'Футболка женская черная', '&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;b&gt;Футболка женская «Классика»&lt;/b&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Размер (Европа)&lt;/td&gt;\r\n&lt;td&gt;Размер (Россия)&lt;/td&gt;\r\n&lt;td&gt;Длина, см&lt;/td&gt;\r\n&lt;td&gt;Обхват груди, см&lt;/td&gt;\r\n&lt;td&gt;Длина плеч, см&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XS&lt;/td&gt;\r\n&lt;td&gt;42&lt;/td&gt;\r\n&lt;td&gt;59&lt;/td&gt;\r\n&lt;td&gt;84&lt;/td&gt;\r\n&lt;td&gt;9&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;92&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;95&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;98&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65,5&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'Футболка женская', 'Футболка женская черная', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('77', '1', 'Футболка женская белая', '&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;b&gt;Футболка женская «Классика»&lt;/b&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Размер (Европа)&lt;/td&gt;\r\n&lt;td&gt;Размер (Россия)&lt;/td&gt;\r\n&lt;td&gt;Длина, см&lt;/td&gt;\r\n&lt;td&gt;Обхват груди, см&lt;/td&gt;\r\n&lt;td&gt;Длина плеч, см&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XS&lt;/td&gt;\r\n&lt;td&gt;42&lt;/td&gt;\r\n&lt;td&gt;59&lt;/td&gt;\r\n&lt;td&gt;84&lt;/td&gt;\r\n&lt;td&gt;9&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;92&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;95&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;98&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65,5&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;br&gt;&lt;/p&gt;', 'Футболка женская', 'Футболка женская белая', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('101', '1', 'Светящаяся футболка  LED Английский флаг', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Светящаяся LED &amp;nbsp;футболка - череп с встроенной LED панелью – это отличный образец современной, клубной одежды.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;LED панель функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;А если вы будете использовать наши светящиеся бейсболки, то восхищенное внимание окружающих, гарантировано.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Дизайн светящейся панели, предусматривает использование, как одного цвета, так и их комбинацию. &amp;nbsp;Мы используем футболки глубокого, черного цвета, для достижения максимального результата.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Источники питания – три элемента ААА («мизинчиковые» батарейки).&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;В отличии от моделей предыдущих поколений, где светящаяся &amp;nbsp;панель пришита к футболке, что исключает ее стирку. Блок управления, требует отдельного размещения и провода, для соединения с экраном, новая модель предусматривает единый с панелью, компактный блок, который крепится на уровне груди, с помощью застежек «липучка».&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;При стирке он легко отсоединяется и так же крепится.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;LED панель (эквалайзер) представляет собой полноценное электронное устройство, которое помимо &amp;nbsp;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Сама святящаяся футболка изготовлена из высококачественного трикотажа, содержащего – 100% хлопка, по европейским лекалам. Специальная система конструкции воротника предотвращает его преждевременное растягивание. Плотность ткани составляет – 180 г/кв.м., что позволяет использовать &amp;nbsp;ее на протяжении длительного времени без ущерба для внешнего вида.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Святящаяся футболка - выделись из толпы.&lt;/span&gt;&lt;/p&gt;', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер', 'LED футболка - АнглийсСветящаяся   футболка эквалайзер LEDкий флаг', 'Светящиеся футболки и бейсболки| Акция| 990 рублей', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('103', '1', 'Светящаяся футболка  LED  Канабис ', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Светящаяся LED &amp;nbsp;футболка - череп с встроенной LED панелью – это отличный образец современной, клубной одежды.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;LED панель функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;А если вы будете использовать наши светящиеся бейсболки, то восхищенное внимание окружающих, гарантировано.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Дизайн светящейся панели, предусматривает использование, как одного цвета, так и их комбинацию. &amp;nbsp;Мы используем футболки глубокого, черного цвета, для достижения максимального результата.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Источники питания – три элемента ААА («мизинчиковые» батарейки).&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;В отличии от моделей предыдущих поколений, где светящаяся &amp;nbsp;панель пришита к футболке, что исключает ее стирку. Блок управления, требует отдельного размещения и провода, для соединения с экраном, новая модель предусматривает единый с панелью, компактный блок, который крепится на уровне груди, с помощью застежек «липучка».&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;При стирке он легко отсоединяется и так же крепится.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;LED панель (эквалайзер) представляет собой полноценное электронное устройство, которое помимо &amp;nbsp;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Сама святящаяся футболка изготовлена из высококачественного трикотажа, содержащего – 100% хлопка, по европейским лекалам. Специальная система конструкции воротника предотвращает его преждевременное растягивание. Плотность ткани составляет – 180 г/кв.м., что позволяет использовать &amp;nbsp;ее на протяжении длительного времени без ущерба для внешнего вида.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Святящаяся футболка - выделись из толпы.&lt;/span&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер', ' Светящаяся   футболка эквалайзер LED', 'Светящиеся футболки и бейсболки| Акция| 990 рублей', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('104', '1', 'Светящаяся футболка  LED Playboy', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Светящаяся LED &amp;nbsp;футболка - череп с встроенной LED панелью – это отличный образец современной, клубной одежды.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;LED панель функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;А если вы будете использовать наши светящиеся бейсболки, то восхищенное внимание окружающих, гарантировано.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Дизайн светящейся панели, предусматривает использование, как одного цвета, так и их комбинацию. &amp;nbsp;Мы используем футболки глубокого, черного цвета, для достижения максимального результата.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Источники питания – три элемента ААА («мизинчиковые» батарейки).&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;В отличии от моделей предыдущих поколений, где светящаяся &amp;nbsp;панель пришита к футболке, что исключает ее стирку. Блок управления, требует отдельного размещения и провода, для соединения с экраном, новая модель предусматривает единый с панелью, компактный блок, который крепится на уровне груди, с помощью застежек «липучка».&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;При стирке он легко отсоединяется и так же крепится.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;LED панель (эквалайзер) представляет собой полноценное электронное устройство, которое помимо &amp;nbsp;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Сама святящаяся футболка изготовлена из высококачественного трикотажа, содержащего – 100% хлопка, по европейским лекалам. Специальная система конструкции воротника предотвращает его преждевременное растягивание. Плотность ткани составляет – 180 г/кв.м., что позволяет использовать &amp;nbsp;ее на протяжении длительного времени без ущерба для внешнего вида.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Святящаяся футболка - выделись из толпы.&lt;/span&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер', ' Светящаяся   футболка эквалайзер LED', 'Светящиеся футболки и бейсболки| Акция| 990 рублей', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер');
