0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Святящаяся футболка - выделись из толпы.&lt;/span&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер', ' Светящаяся   футболка эквалайзер LED', 'Светящиеся футболки и бейсболки| Акция| 990 рублей', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('97', '1', 'Светящаяся футболка  LED детская  &quot;Харлей Девидсон&quot;', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Светящаяся LED &amp;nbsp;футболка - череп с встроенной LED панелью – это отличный образец современной, клубной одежды.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;LED панель функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;А если вы будете использовать наши светящиеся бейсболки, то восхищенное внимание окружающих, гарантировано.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Дизайн светящейся панели, предусматривает использование, как одного цвета, так и их комбинацию. &amp;nbsp;Мы используем футболки глубокого, черного цвета, для достижения максимального результата.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники питания – три элемента ААА («мизинчиковые» батарейки).&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В отличии от моделей предыдущих поколений, где светящаяся &amp;nbsp;панель пришита к футболке, что исключает ее стирку. Блок управления, требует отдельного размещения и провода, для соединения с экраном, новая модель предусматривает единый с панелью, компактный блок, который крепится на уровне груди, с помощью застежек «липучка».&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;При стирке он легко отсоединяется и так же крепится.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;LED панель (эквалайзер) представляет собой полноценное электронное устройство, которое помимо &amp;nbsp;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Сама святящаяся футболка изготовлена из высококачественного трикотажа, содержащего – 100% хлопка, по европейским лекалам. Специальная система конструкции воротника предотвращает его преждевременное растягивание. Плотность ткани составляет – 180 г/кв.м., что позволяет использовать &amp;nbsp;ее на протяжении длительного времени без ущерба для внешнего вида.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Святящаяся футболка - выделись из толпы.&lt;/p&gt;', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер', 'Светящаяся   футболка эквалайзер LED детская - Harley Devidson', 'Светящиеся футболки и бейсболки| Акция| 990 рублей', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер');
