n;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Святящаяся футболка - выделись из толпы.&lt;/span&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер', ' Светящаяся   футболка эквалайзер LED', 'Светящиеся футболки и бейсболки| Акция| 990 рублей', 'Светящаяся,футболка,LED,бейсболка,клубная одежда, эквалайзер');
