INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('117', '1', 'Футболка приталенная серая женская', '&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;&lt;b&gt;Футболка женская «Приталенная»&lt;/b&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Размер (Европа)&lt;/td&gt;\r\n&lt;td&gt;Размер (Россия)&lt;/td&gt;\r\n&lt;td&gt;Длина, см&lt;/td&gt;\r\n&lt;td&gt;Обхват груди, см&lt;/td&gt;\r\n&lt;td&gt;Длина плеч, см&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XS&lt;/td&gt;\r\n&lt;td&gt;42&lt;/td&gt;\r\n&lt;td&gt;59&lt;/td&gt;\r\n&lt;td&gt;84&lt;/td&gt;\r\n&lt;td&gt;9&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;92&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;95&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;98&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65,5&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', '', 'Футболка приталенная серая женская - СЕО', '', '');
