INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('131', '1', 'Майка мужская серая', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; font-weight: bold; line-height: normal;&quot;&gt;Майка мужская серая&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;/span&gt;&lt;wbr&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;ых тканей из хлопка – принадлежащем компании «&lt;/span&gt;&lt;span xml:lang=&quot;en-US&quot; style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;».&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&q