INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('133', '1', 'Майка мужская белая', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; font-weight: bold; line-height: normal;&quot;&gt;Майка мужская белая&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;/span&gt;&lt;wbr&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;ых тканей из хлопка – принадлежащем компании «&lt;/span&gt;&lt;span xml:lang=&quot;en-US&quot; style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;».&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;', '', 'Майка мужская белая - СЕО', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('134', '1', 'Майка мужская черная', '&lt;p style=&quot;margin-bottom: 0in; font-size: 14px; line-height: 20px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; font-weight: bold; line-height: normal;&quot;&gt;Майка мужская черная&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;/span&gt;&lt;wbr&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;ых тканей из хлопка – принадлежащем компании «&lt;/span&gt;&lt;span xml:lang=&quot;en-US&quot; style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;».&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;', '', 'Майка мужская черная - СЕО', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('136', '1', 'Бейсболка детская эквалайзер &quot;Старина Харли&quot;', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;b&gt;Бейсболка эквалайзер&lt;/b&gt;&lt;b&gt;&lt;/b&gt;&amp;nbsp;– это отличный образец современной, клубной одежда.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель (эквалйзер)&amp;nbsp; функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник звука.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;А если вы будете использовать наши футболки с&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панелями (эквалайзерами) и&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;аксессуарами, то восхищенное внимание окружающих, гарантировано.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Дизайн&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&amp;nbsp;панели(эквалайзера), предусматривает использование, как одного&amp;nbsp;&amp;nbsp;цвета, так и их комбинацию. Ассортимент позволяет выбрать наиболее понравившийся цвет и изображение.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Мы используем бейсболки глубокого, черного цвета, для достижения максимального результата.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Источники питания – элемент&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;&amp;nbsp;2032 («часовые» батарейки).&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;В отличии от моделей предыдущих поколений, где панель пришита к бейсболке, что исключает ее стирку, новая модель предусматривает компактный блок, который крепится, с помощью застежек «липучка».&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;При стирке он легко отсоединяется и так же присоединяется.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель (эквалайзер)&amp;nbsp; представляет собой полноценное электронное устройство, которое помимо&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;', 'Эквалайзер,бейсболка,клубная,LED', 'Бейсболка эквалайзер детская', 'Бейсболка эквалайзер детская. Акция. 890рублей.', 'Эквалайзер. Бейсболка. Детская. Акция.');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('135', '1', 'Бейсболка эквалайзер  Playboy', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;b&gt;Бейсболка эквалайзер&lt;/b&gt;&lt;b&gt;&lt;/b&gt;&amp;nbsp;– это отличный образец современной, клубной одежда.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель (эквалйзер)&amp;nbsp; функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник звука.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;А если вы будете использовать наши футболки с&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панелями (эквалайзерами) и&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;аксессуарами, то восхищенное внимание окружающих, гарантировано.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Дизайн&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&amp;nbsp;панели(эквалайзера), предусматривает использование, как одного&amp;nbsp;&amp;nbsp;цвета, так и их комбинацию. Ассортимент позволяет выбрать наиболее понравившийся цвет и изображение.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Мы используем бейсболки глубокого, черного цвета, для достижения максимального результата.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Источники питания – элемент&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;&amp;nbsp;2032 («часовые» батарейки).&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;В отличии от моделей предыдущих поколений, где панель пришита к бейсболке, что исключает ее стирку, новая модель предусматривает компактный блок, который крепится, с помощью застежек «липучка».&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;При стирке он легко отсоединяется и так же присоединяется.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель (эквалайзер)&amp;nbsp; представляет собой полноценное электронное устройство, которое помимо&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;', 'Эквалайзер,бейсболка,клубная,LED', 'Бейсболка эквалайзер  - playboy', 'Бейсболка эквалайзер. Акция. 890рублей', 'Эквалайзер. Бейсболка. Акция.');
