&quot;List Table 1 Light Accent 6&quot;&gt;&lt;/w:LsdException&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;47&quot; Name=&quot;List Table 2 Accent 6&quot;&gt;&lt;/w:LsdException&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;48&quot; Name=&quot;List Table 3 Accent 6&quot;&gt;&lt;/w:LsdException&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;49&quot; Name=&quot;List Table 4 Accent 6&quot;&gt;&lt;/w:LsdException&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;50&quot; Name=&quot;List Table 5 Dark Accent 6&quot;&gt;&lt;/w:LsdException&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;51&quot;\r\n   Name=&quot;List Table 6 Colorful Accent 6&quot;&gt;&lt;/w:LsdException&gt;\r\n  &lt;w:LsdException Locked=&quot;false&quot; Priority=&quot;52&quot;\r\n   Name=&quot;List Table 7 Colorful Accent 6&quot;&gt;&lt;/w:LsdException&gt;\r\n &lt;/w:LatentStyles&gt;\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]&gt;\r\n&lt;style&gt;\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n\t{mso-style-name:&quot;Обычная таблица&quot;;\r\n\tmso-tstyle-rowband-size:0;\r\n\tmso-tstyle-colband-size:0;\r\n\tmso-style-noshow:yes;\r\n\tmso-style-priority:99;\r\n\tmso-style-parent:&quot;&quot;;\r\n\tmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n\tmso-para-margin-top:0cm;\r\n\tmso-para-margin-right:0cm;\r\n\tmso-para-margin-bottom:8.0pt;\r\n\tmso-para-margin-left:0cm;\r\n\tline-height:107%;\r\n\tmso-pagination:widow-orphan;\r\n\tfont-size:11.0pt;\r\n\tfont-family:&quot;Calibri&quot;,sans-serif;\r\n\tmso-ascii-font-family:Calibri;\r\n\tmso-ascii-theme-font:minor-latin;\r\n\tmso-hansi-font-family:Calibri;\r\n\tmso-hansi-theme-font:minor-latin;\r\n\tmso-fareast-language:EN-US;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;b&gt;Бейсболка эквалайзер&lt;/b&gt;&lt;b&gt;&lt;/b&gt;&amp;nbsp;– это отличный образец современной, клубной одежда.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель (эквалйзер)&amp;nbsp; функционирует по принципу светового индикатора, эквалайзера, т.е. изображение пульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой другой источник звука.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;В такой одежде вы не останетесь, незамеченным ни в одной компании, ни на одной вечеринке.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;А если вы будете использовать наши футболки с&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панелями (эквалайзерами) и&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;аксессуарами, то восхищенное внимание окружающих, гарантировано.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Дизайн&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&amp;nbsp;панели(эквалайзера), предусматривает использование, как одного&amp;nbsp;&amp;nbsp;цвета, так и их комбинацию. Ассортимент позволяет выбрать наиболее понравившийся цвет и изображение.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Мы используем бейсболки глубокого, черного цвета, для достижения максимального результата.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;Источники питания – элемент&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LR&lt;/span&gt;&amp;nbsp;2032 («часовые» батарейки).&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;В отличии от моделей предыдущих поколений, где панель пришита к бейсболке, что исключает ее стирку, новая модель предусматривает компактный блок, который крепится, с помощью застежек «липучка».&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;При стирке он легко отсоединяется и так же присоединяется.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;панель (эквалайзер)&amp;nbsp; представляет собой полноценное электронное устройство, которое помимо&amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;дисплея, включает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n', 'Эквалайзер,бейсболка,клубная,LED', 'Бейсболка эквалайзер детская', 'Бейсболка эквалайзер детская. Акция. 890рублей.', 'Эквалайзер. Бейсболка. Детская. Акция.');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('153', '1', 'Закаленное стекло c эффектом 2,5D для HTC M7', '&lt;p&gt;Защитное, закаленное, сверх- прочное&amp;nbsp;стекло надежно защитит экран вашего смартфона от повреждений, царапин и потертостей. Толщина &amp;nbsp;стекла всего - 0,3мм, при этом за счет закаливания, оно имеет высокие прочностные характеристики. Специальная технология, используемая при изготовлении, позволила создать эффект трех-мерности&amp;nbsp; на дисплее. &amp;nbsp;Края стекла специально закруглены для удобства использования. &amp;nbsp;Стекло легко крепится на дисплей телефона. На многих современных телефонах замена стекла дисплея автоматически влечет замену самого дисплея. Потратив несколько сотен рублей на защитное стекло, можно сэкономить&amp;nbsp; несколько тысяч на дорогостоящем ремонте, который выведет из строя ваш телефон на несколько дней, а то и недель.&lt;/p&gt;&lt;p&gt;Подробная инструкция по установке защитного стекла&amp;nbsp;напечатана на упаковке товара. В комплекте идут специальные приспособления для удаления пылинок, при наклейки, спиртовая салфетка и салфетка для финальной очистки дисплея. В отличии от защитной пленки, наклеить защитное стекло намного проще. Т.к. поверхность защитного стекла гораздо тверже, воздух между экраном и стеклом выдавливается под его весом и не образует &quot;пузырьков&quot; при наклеивании.&lt;/p&gt;', 'Защитное,закаленное,стекло,сверх-,прочное,2,5D', 'Защитное закаленное стекло ', 'Защитное, закаленное, сверх-прочное стекло с эффектом 2,5D. Низкие цены.', 'Защита, закаленное, для смартфона, сверх-, прочное. ');
