INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('159', '1', 'Закаленное стекло c эффектом 2,5D для  Ipad 5', '&lt;p&gt;Защитное, закаленное, сверх- прочное&amp;nbsp;стекло надежно защитит экран вашего смартфона от повреждений, царапин и потертостей. Толщина &amp;nbsp;стекла всего - 0,3мм, при этом за счет закаливания, оно имеет высокие прочностные характеристики. Специальная технология, используемая при изготовлении, позволила создать эффект трех-мерности&amp;nbsp; на дисплее. &amp;nbsp;Края стекла специально закруглены для удобства использования. &amp;nbsp;Стекло легко крепится на дисплей телефона. На многих современных телефонах замена стекла дисплея автоматически влечет замену самого дисплея. Потратив несколько сотен рублей на защитное стекло, можно сэкономить&amp;nbsp; несколько тысяч на дорогостоящем ремонте, который выведет из строя ваш телефон на несколько дней, а то и недель.&lt;/p&gt;&lt;p&gt;Подробная инструкция по установке защитного стекла&amp;nbsp;напечатана на упаковке товара. В комплекте идут специальные приспособления для удаления пылинок, при наклейки, спиртовая салфетка и салфетка для финальной очистки дисплея. В отличии от защитной пленки, наклеить защитное стекло намного проще. Т.к. поверхность защитного стекла гораздо тверже, воздух между экраном и стеклом выдавливается под его весом и не образует &quot;пузырьков&quot; при наклеивании.&lt;/p&gt;', 'Защитное,закаленное,стекло,сверх-,прочное,2,5D', 'Защитное закаленное стекло ', 'Защитное, закаленное, сверх-прочное стекло с эффектом 2,5D. Низкие цены.', 'Защита, закаленное, для смартфона, сверх-, прочное. ');
