INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('183', '1', 'USB кабель, плетенный для зарядки телефона и передачи данных, разъем 8(pin) для Iphone 5', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 8(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'кабель usb - Iphone5 для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('185', '1', 'USB кабель светящийся для iphone 4 для зарядки телефона и передачи данных, разъем 30(pin) для Iphone 4', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 30(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель - iphone 4 для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('191', '1', 'USB кабель для зарядки телефона и передачи данных 3 в 1, разъемы micro USB, Iphone 3-4, Iphone 5-6', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель3&amp;nbsp;в 1 &amp;nbsp;выполнен в виде армейского, швейцарского ножа. Имеющиеся разъемы позволяют&amp;nbsp;подключать к его к практически любому современному телефону/смартфону, в т.ч. ко всем аппаратам семейства IPhone.&amp;nbsp; Представлена широкая цветовая гамма. &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем microUSB, 30pin (IPhone 3-4), 8pin(IPhone 5-6).&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона 3 в 1', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('193', '1', 'Набор внешних фото-объективов  3 в 1', '&lt;p&gt;Объективы подходят для любого телефона, планшета, ноутбука.&lt;/p&gt;&lt;p&gt;Набор состоит из трех &amp;nbsp;внешних объективов: 1. Широкоугольный объектив, позволяющий значительно расширить угол захвата изображения встроенной камеры 2. Макро объектив, позволяющий использовать телефон, как микроскоп 3. Объектив , позволяющий делать снимки с эффектом &quot;Рыбий глаз&quot; (выпуклые изображения)&amp;nbsp;&lt;/p&gt;', '', 'Внешний объектив 3 в 1', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('194', '1', 'Набор внешних фото-объективов  4 в 1', '&lt;p&gt;Объективы подходят для любого телефона, планшета, ноутбука.&lt;/p&gt;&lt;p&gt;Набор состоит из четырех внешних объективов: 1. Широкоугольный объектив, позволяющий значительно расширить угол захвата изображения встроенной камеры 2. Макро объектив, позволяющий использовать телефон, как микроскоп 3. Объектив , позволяющий делать снимки с эффектом &quot;Рыбий глаз&quot; (выпуклые изображения) 4. Объектив, позволяющий делать снимки со сферическими эффектами.&lt;/p&gt;', '', 'Внешний объектив 4 в 1 ', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('195', '1', 'Телескопический внешний объектив ', '&lt;p&gt;Телескопический внешний объектив позволяет использовать цифровой зум для встроенной камеры смартфона/планшета/компьютера. За счет универсального крепления легко использовать с любыми устройствами имеющими встроенную камеру.&lt;/p&gt;', '', 'Телескопический объектив', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('198', '1', 'Внешний аккумулятор для смартфона 5200 mAh,пластик', '&lt;p&gt;Внешний аккумулятор поможет реанимировать ваш телефон , если его батарея неожиданно &quot;села&quot;. Легкий и компактный он поместиться в кармане или дамской сумочке. &amp;nbsp;Корпус сделан из высококачественного &amp;nbsp;пластика разных расцветок. С помощью соответствующего USB кабеля, внешний аккумулятор может зарядить, не только телефон, но и &amp;nbsp;любое другое устройство заряжаемое от сети.&amp;nbsp;&lt;br&gt;&lt;/p&gt;', '', 'Внешний аккумулятор - 5200 mAh', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('201', '1', 'Внешний аккумулятор для смартфона, 2600mAh, пластик ', '&lt;p&gt;Внешний аккумулятор поможет реанимировать ваш телефон , если его батарея неожиданно &quot;села&quot;. Легкий и компактный он поместиться в кармане или дамской сумочке. Корпус сделан из высококачественного &amp;nbsp;пластика разных расцветок. С помощью соответствующего USB кабеля, внешний аккумулятор может зарядить, не только телефон, но и &amp;nbsp;любое другое устройство заряжаемое от сети.&amp;nbsp;&lt;br&gt;&lt;/p&gt;', '', 'Внешний аккумулятор - 2600mAh ', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('200', '1', 'Внешний аккумулятор для смартфона 2600 mAh,алюминий + фонарь', '&lt;p&gt;Внешний аккумулятор поможет реанимировать ваш телефон , если его батарея неожиданно &quot;села&quot;. Легкий и компактный он поместиться в кармане или дамской сумочке. Корпус сделан из анодированного алюминия разных расцветок. Данная модель имеет встроенный светодиодный фонарь. С помощью соответствующего USB кабеля, внешний аккумулятор может зарядить, не только телефон, но и &amp;nbsp;любое другое устройство заряжаемое от сети.&amp;nbsp;&lt;br&gt;&lt;/p&gt;', '', 'Внешний аккумулятор - 2600', '', '');
