INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('196', '1', 'Широкоугольный внешний объектив ', '&lt;p&gt;Внешний широкоугольный объектив подходит к любому телефону, планшету и ноутбуку, в котором есть встроенная видеокамера. Данное устройство позволяет значительно расширить угол захвата встроенной камеры, и как следствие делать групповые снимки в ограниченном пространстве. Объектив пригодится вам, как при отъезде на отдых, так и в повседневной жизни.&lt;/p&gt;', '', 'Широкоугольный объектив', '', '');
