INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('202', '1', 'Внешний аккумулятор для смартфона, 10400.алюминий', '&lt;p&gt;Внешний аккумулятор поможет реанимировать ваш телефон , если его батарея неожиданно &quot;села&quot;. Легкий и компактный он поместиться в кармане или дамской сумочке. Корпус сделан из высококачественного &amp;nbsp;пластика разных расцветок. С помощью соответствующего USB кабеля, внешний аккумулятор может зарядить, не только телефон, но и &amp;nbsp;любое другое устройство заряжаемое от сети.&amp;nbsp;&lt;br&gt;&lt;/p&gt;', 'Power bank,Внешний, аккумулятор,iPhone, samsung ', 'внешний аккумулятор-1040', 'Внешний аккумулятор для телефона ( power bank)|Акция|1290рублей', 'Внешний аккумулятор, power bank, iPhone, samsung,');
