INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('125', '1', 'Футболка мужская белая классическая', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; font-weight: bold; line-height: normal;&quot;&gt;Футболка мужская белая классическая&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;/span&gt;&lt;wbr&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;ых тканей из хлопка – принадлежащем компании «&lt;/span&gt;&lt;span xml:lang=&quot;en-US&quot; style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;».&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;67&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;96&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;69&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;100&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;11&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;71&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;12&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;73&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;110&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;13&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XXL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;52&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;77&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;114&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;15&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', '', 'Футболка мужская белая классическая - СЕО', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('206', '1', 'Монопод Z 18-2 с встроенным управлением', '&lt;p class=&quot;MsoNormal&quot;&gt;Монопод- оригинальное устройство для облегчения процесса\r\nсъёмки автопортретов ( «селфи»). Они появились сравнительно недавно. С\r\nсовершенствованием фото камер в мобильных телефонах, появилась возможность\r\nполучать достаточно качественные снимки для размещения их в первую очередь, в\r\nсоциальных сетях. &lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;/p&gt;Монопод представляет собой раздвижной штатив с ручным (\r\nпроводной) или автоматическим управлением (&lt;span lang=&quot;EN-US&quot;&gt;bluetooth &lt;/span&gt;технология) фото камерой мобильного телефона. На конце\r\nштатива размещена рамка для крепления телефона, как правило она настраивается\r\nпод любой размер аппарата.', '', 'монопод', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('207', '1', 'Монопод Z 18-3  с дистанционным управлением (Bluetooth shutter)', '&lt;br&gt;&lt;p class=&quot;MsoNormal&quot;&gt;Монопод- оригинальное устройство для облегчения процесса\r\nсъёмки автопортретов ( «селфи»). Они появились сравнительно недавно. С\r\nсовершенствованием фото камер в мобильных телефонах, появилась возможность\r\nполучать достаточно качественные снимки для размещения их в первую очередь, в\r\nсоциальных сетях. &lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;/p&gt;Монопод представляет собой раздвижной штатив с ручным (\r\nпроводной) или автоматическим управлением (&lt;span lang=&quot;EN-US&quot;&gt;bluetooth &lt;/span&gt;технология) фото камерой мобильного телефона. На конце\r\nштатива размещена рамка для крепления телефона, как правило она настраивается\r\nпод любой размер аппарата.', '', 'монопод', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('76', '1', 'Футболка женская серая', '&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;b&gt;Футболка женская «Классика»&lt;/b&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Размер (Европа)&lt;/td&gt;\r\n&lt;td&gt;Размер (Россия)&lt;/td&gt;\r\n&lt;td&gt;Длина, см&lt;/td&gt;\r\n&lt;td&gt;Обхват груди, см&lt;/td&gt;\r\n&lt;td&gt;Длина плеч, см&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XS&lt;/td&gt;\r\n&lt;td&gt;42&lt;/td&gt;\r\n&lt;td&gt;59&lt;/td&gt;\r\n&lt;td&gt;84&lt;/td&gt;\r\n&lt;td&gt;9&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;92&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;95&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;98&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65,5&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'Футболка женская', 'Футболка женская серая', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('115', '1', 'Футболка приталенная белая женская ', '&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;&lt;b&gt;Футболка женская «Приталенная»&lt;/b&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Размер (Европа)&lt;/td&gt;\r\n&lt;td&gt;Размер (Россия)&lt;/td&gt;\r\n&lt;td&gt;Длина, см&lt;/td&gt;\r\n&lt;td&gt;Обхват груди, см&lt;/td&gt;\r\n&lt;td&gt;Длина плеч, см&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XS&lt;/td&gt;\r\n&lt;td&gt;42&lt;/td&gt;\r\n&lt;td&gt;59&lt;/td&gt;\r\n&lt;td&gt;84&lt;/td&gt;\r\n&lt;td&gt;9&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;92&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;95&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;98&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65,5&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', '', 'Футболка приталенная белая женская -СЕО', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('116', '1', 'Футболка приталенная синяя женская', '&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;&lt;b&gt;Футболка женская «Приталенная»&lt;/b&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Размер (Европа)&lt;/td&gt;\r\n&lt;td&gt;Размер (Россия)&lt;/td&gt;\r\n&lt;td&gt;Длина, см&lt;/td&gt;\r\n&lt;td&gt;Обхват груди, см&lt;/td&gt;\r\n&lt;td&gt;Длина плеч, см&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XS&lt;/td&gt;\r\n&lt;td&gt;42&lt;/td&gt;\r\n&lt;td&gt;59&lt;/td&gt;\r\n&lt;td&gt;84&lt;/td&gt;\r\n&lt;td&gt;9&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;92&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;95&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;9,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;98&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;65,5&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', '', 'Футболка приталенная синяя женская - СЕО', '', '');
