INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('208', '1', 'USB кабель для зарядки телефона и передачи данных (2 в 1), разъемы для Iphone 3-4 и Iphone 5-6', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель 2&amp;nbsp;в 1&amp;nbsp;выполнен в виде маленькой сумочки, что позволяет ему занимать минимум места. При этом с его помощью вы можете заряжать, сразу 2 типа IPhone, модели 3-4 и 5-6.&amp;nbsp; Представлена широкая цветовая гамма. &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам марки Iphone.&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона 2 в 1', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('129', '1', 'Футболка мужская синяя приталенная', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; font-weight: bold; line-height: normal;&quot;&gt;Футболка мужская синяя приталенная&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;/span&gt;&lt;wbr&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;ых тканей из хлопка – принадлежащем компании «&lt;/span&gt;&lt;span xml:lang=&quot;en-US&quot; style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;».&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;67&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;96&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;69&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;100&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;11&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;71&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;12&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;73&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;110&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;13&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XXL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;52&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;77&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;114&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;15&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', '', 'Футболка мужская синяя приталенная - СЕО', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('130', '1', 'Футболка мужская черная приталенная', '&lt;p style=&quot;margin-bottom: 0in;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; font-weight: bold; line-height: normal;&quot;&gt;Футболка мужская черная приталенная&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;&amp;nbsp;– самая популярная модель во все времена. Может как подчеркнуть достоинства, так и скрыть недостатки, фигуры. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;/span&gt;&lt;wbr&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;ых тканей из хлопка – принадлежащем компании «&lt;/span&gt;&lt;span xml:lang=&quot;en-US&quot; style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;&lt;span style=&quot;font-size: 16px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif;&quot;&gt;».&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;margin-bottom: 0in; color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;S&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;44&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;67&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;96&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;10,5&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;M&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;69&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;100&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;11&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;L&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;48&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;71&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;104&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;12&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;50&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;73&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;110&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;13&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;XXL&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;52&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;77&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;114&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;15&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', '', 'Футболка мужская черная приталенная - СЕО', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('71', '1', 'Футболка детская белая', '&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;b&gt;Футболка детская&lt;/b&gt;&amp;nbsp;– пошита, как классическая модель, что позволяет легко подобрать необходимый размер. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Возраст&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Размер&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Рост&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Длина изделия&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Обхват груди&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;3-4 года&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;28&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;110&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;42&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;5-6 лет&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;30&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;116&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;42&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;7-8 лет&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;32&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;128&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;68&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;9-10 лет&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;34&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;140&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;49&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;74&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'Футболка детская', 'Футболка детская белая', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('70', '1', 'Футболка детская серая', '&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;b&gt;Футболка детская&lt;/b&gt;&amp;nbsp;– пошита, как классическая модель, что позволяет легко подобрать необходимый размер. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Возраст&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Размер&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Рост&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Длина изделия&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Обхват груди&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;3-4 года&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;28&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;110&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;42&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/