INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('69', '1', 'Футболка детская черная', '&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;&lt;b&gt;Футболка детская&lt;/b&gt;&amp;nbsp;– пошита, как классическая модель, что позволяет легко подобрать необходимый размер. Пошита из трикотажа «пенье» («премиум» класс»), производимом на одном из крупнейших в мире, производств высококачественн&lt;wbr&gt;ых тканей из хлопка – принадлежащем компании «&lt;span xml:lang=&quot;en-US&quot; lang=&quot;en-US&quot;&gt;Saka&lt;/span&gt;».&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Все наши модели имеют в своей основе, современные европейские лекала. Специальная конструкция воротника с вшитой в него тесьмой позволяет успешно противостоять его вытягиванию. Состав изделия: 92% - хлопка и 8% лайкры, придает футболке мягкость и шелковистость, ткань как будто переливается на солнце.&lt;/p&gt;\r\n&lt;p style=&quot;color: rgb(0, 0, 0); font-family: \'Times New Roman\', Times, serif; font-size: 16px; line-height: normal; margin-bottom: 0in;&quot;&gt;Плотность ткани – 230 г/кв.м. позволяет значительно увеличить срок носки, по сравнению с аналогами.&lt;/p&gt;\r\n&lt;table class=&quot;table table-bordered&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Возраст&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Размер&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Рост&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Длина изделия&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;Обхват груди&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;3-4 года&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;28&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;110&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;42&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;63&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;5-6 лет&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;30&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;116&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;42&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;64&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;7-8 лет&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;32&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;128&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;46&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;68&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;9-10 лет&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;34&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;140&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;49&lt;br&gt;&lt;/td&gt;\r\n&lt;td&gt;74&lt;br&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;', 'Футболка детская', 'Футболка детская черная', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('211', '1', 'USB кабель стандартный для Iphone 4 для зарядки телефона и передачи данных, разъем 30(pin) для Iphone 4', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 30(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'кабель стандарт  для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('215', '1', 'USB кабель для зарядки телефона и передачи данных (smile face), разъем 8(pin) для Iphone 5-6', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 8(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'кабель smile для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
