INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('181', '1', 'Комплект закаленных стекол.зеркальное серебро для Iphone 5', '&lt;p&gt;Защитное, закаленное, сверх- прочное&amp;nbsp;стекло надежно защитит экран вашего смартфона от повреждений, царапин и потертостей. Толщина &amp;nbsp;стекла всего - 0,3мм, при этом за счет закаливания, оно имеет высокие прочностные характеристики. Специальная технология, используемая при изготовлении, позволила создать эффект трех-мерности&amp;nbsp; на дисплее. &amp;nbsp;Края стекла специально закруглены для удобства использования. &amp;nbsp;Стекло легко крепится на дисплей телефона. На многих современных телефонах замена стекла дисплея автоматически влечет замену самого дисплея. Потратив несколько сотен рублей на защитное стекло, можно сэкономить&amp;nbsp; несколько тысяч на дорогостоящем ремонте, который выведет из строя ваш телефон на несколько дней, а то и недель.&lt;/p&gt;&lt;p&gt;Подробная инструкция по установке защитного стекла&amp;nbsp;напечатана на упаковке товара. В комплекте идут специальные приспособления для удаления пылинок, при наклейки, спиртовая салфетка и салфетка для финальной очистки дисплея. В отличии от защитной пленки, наклеить защитное стекло намного проще. Т.к. поверхность защитного стекла гораздо тверже, воздух между экраном и стеклом выдавливается под его весом и не образует &quot;пузырьков&quot; при наклеивании.&lt;/p&gt;', '', 'Комплект закаленных стекол серебро для Iphone 5', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('222', '1', 'USB кабель для зарядки телефона и передачи данных (детский дизайн),  разъем 8(pin), для Iphone 5-6', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 8(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'кабель детский для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
