INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('286', '1', 'Накладка для навигационной клавиши Iphone силиконовая, без рисунка, черная', '&lt;p&gt;Небольшие, но яркие аксессуары - оригинальные накладки на кнопки &quot;Домой&quot; для смартфонов Apple и Samsung, придадут вашему устройству оригинальность.&lt;br&gt;&lt;br&gt;Накладки необходимы, также при установке защитных стекол, для создания ровной поверхности передней панели&lt;br&gt;&lt;/p&gt;', '', 'накладка-айфон', '', '');
