INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('320', '1', 'НАУШНИКИ ЗАМОК-МОЛНИЯ (ZIPPER) ', '&lt;p&gt;Наушники-молния помимо необычного дизайна, обладают еще одной ценной особенностью, а именно возможностью застегнуть молнию и получить вместо двух тонких проводов, которые постоянно норовят переплестись - один довольно широкий кабель. Это удобно, особенно при ношении их на улице. Наушники Zipper выдают хороший и качественный звук.&lt;br&gt;&lt;/p&gt;', '', 'Наушники молния', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('319', '1', 'НАУШНИКИ СВЕТЯЩИЕСЯ GLOW ', '&lt;p&gt;Встречайте ХИТ этого сезона, новые, высокотехнологичные, светящиеся наушники GLOW - со встроенными светодиодами, датчиком-улавливателем звуков и управляющим чипом.&lt;/p&gt;&lt;p&gt;Наушники имеют небольшой встроенный аккумулятор, который позволяет работать светодиодам в течении всего дня. Три цвета: белый, красный, фиолетовый.&lt;/p&gt;&lt;p&gt;Только до Нового Года специальная цена - 990 рублей.&lt;/p&gt;', 'наушники,светящиеся,glow,темноте,такт', 'НАУШНИКИ СВЕТЯЩИЕСЯ В ТЕМНОТЕ В ТАКТ МУЗЫКЕ', 'Светящиеся  наушники GLOW с встроенным микрофоном и функцией шумоподавления.', 'Светящиеся наушники. В такт музыке. GLOW.');
