INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('316', '1', 'Светящиеся сережки', '&lt;p&gt;&lt;span style=&quot;font-family: \'Arial Black\';&quot;&gt;Светящиеся сережки - незаменимы на тусовках и вечеринках.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Изготовлены из высококачественной стали, с встроенными лед источниками света.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Цвет: серебряный.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Доступен режим непрерывного свечения и мерцания.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 14px; line-height: 20px;&quot;&gt;Размер: 0,7см х2,1см&lt;/p&gt;&lt;p style=&quot;margin-bottom: 10px; font-size: 14px; line-height: 20px;&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Светящиеся сережки используют источники питания: &amp;nbsp;1 элемент&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;LR 521&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Светящиеся сережки, шнурки, очки, браслеты, для вечеринок, акция', 'Светящиеся сережки', 'Светящиеся сережки|Акция|390 рублей|', 'Светящиеся сережки, шнурки, очки, браслеты, для вечеринок, акция');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('317', '1', 'Светящиеся браслеты для вечеринок', '&lt;h4&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Светящиеся браслеты изготовлены из высококачественного пластика, с встроенными лед источниками света.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Доступен режим непрерывного свечения и мерцания.&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Размер 22,5 см х 2 см х 15 см&lt;/span&gt;&lt;/h4&gt;&lt;h4 style=&quot;font-family: \'Open Sans\', sans-serif; color: rgb(102, 102, 102);&quot;&gt;&lt;span style=&quot;font-family: \'Times New Roman\';&quot;&gt;Отличный элемент вашего стиля на любой тусовке.&lt;/span&gt;&lt;/h4&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Светящиеся браслеты используют источники питания: &amp;nbsp;1 элемент CR927+1 элемент *LR927&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Светящиеся, браслеты, серьги, шнурки, очки, футболки', 'Светящиеся браслеты', 'Светящиеся браслеты, серьги,шнурки,очки|от 290 рублей', 'Светящиеся, браслеты, серьги, шнурки, очки, футболки');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('321', '1', 'НАУШНИКИ ЗАМОК-МОЛНИЯ (ZIPPER Premium) ', '&lt;p&gt;Наушники-молния помимо необычного дизайна, обладают еще одной ценной особенностью, а именно возможностью застегнуть молнию и получить вместо двух тонких проводов, которые постоянно норовят переплестись - один довольно широкий кабель. Это удобно, особенно при ношении их на улице. &amp;nbsp;Zipper Premium это чистый и мощный звук, который не оставит тебя равнодушным.&lt;/p&gt;&lt;p&gt;Цветовая гамма: белые, красные, фиолетовые.&lt;/p&gt;', '', 'Наушники молния', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('322', '1', 'Футболка мужская со стразами &quot;Скорпион&quot;', '&lt;p&gt;Футболки с аппликациями из страз. Это новое направление в современной модной индустрии. Аппликации создаются вручную и наносятся на одежду при помощи гидравлического термо- пресса.&lt;/p&gt;&lt;p&gt;Комплекты для влюбленных и всех членов семьи с одинаковыми аппликациями. &amp;nbsp;Большой выбор аппликаций, более, чем 100 разных композиций разной направленности.&lt;/p&gt;', '', 'ОРИГИНАЛЬНЫЕ ФУТБОЛКИ СО СТРАЗАМИ.', 'Оригинальные футболки с аппликациями из страз.  Женские, детские, мужские. Наносим аппликации по вашему выбору. Эксклюзивно в РФ.', 'Футболки. Стразы. Аппликации. Женские. Детские. Для влюбленных.');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('323', '1', 'Футболка женская со стразами &quot;Зеленовласка&quot;', '&lt;p&gt;Футболки с аппликациями из страз. Это новое направление в современной модной индустрии. Аппликации создаются вручную и наносятся на одежду при помощи гидравлического термо- пресса, при температуре около 200 градусов и давлении более 200кг. Такой способ нанесения, гарантирует длительный срок носки без ущерба для аппликации.&lt;/p&gt;&lt;p&gt;Комплекты для влюбленных и всех членов семьи с одинаковыми рисунками. &amp;nbsp;Большой выбор аппликаций на нашем сайте, более, чем 100 разных композиций разной направленности.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Со,стразами,футболки,красивые', 'КРАСИВЫЕ ФУТБОЛКИ СО СТРАЗАМИ.', 'Красивые футболки с аппликациями из страз.  Женские, детские, мужские. Наносим аппликации по вашему выбору. Эксклюзивно в РФ.', 'Футболки. Стразы. Аппликации. Женские. Детские. Для влюбленных.');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('324', '1', 'НАУШНИКИ СВЕТЯЩИЕСЯ ФЛУОРЕСЦЕНТНЫЕ', '&lt;p&gt;Встречайте ХИТ этого сезона, &amp;nbsp;светящиеся флуоресцентные наушники.&lt;/p&gt;&lt;p&gt;Находясь на свету они накапливают энергию, после чего в темноте светятся ярким, ровным светом. Четыре расцветки: белый, красный, фиолетовый.&lt;/p&gt;&lt;p&gt;Имеют встроенный микрофон (выполняют функцию гарнитуры для вашего телефона).&amp;nbsp;&lt;/p&gt;&lt;p&gt;Только до Нового Года специальная цена - 790 рублей.&lt;/p&gt;', 'наушники,светящиеся,glow,темноте,такт, хит', 'СВЕТЯЩИЕСЯ НАУШНИКИ  ФЛУОРЕСЦЕНТНЫЕ', 'Светящиеся  наушники работают без аккумулятора . Акция.', 'Светящиеся наушники. В такт музыке. Флуоресцентные.');
