айзер&lt;/b&gt;&lt;b style=&quot;mso-bidi-font-weight:normal&quot;&gt;&lt;/b&gt; – это отличный образец современной, клубной\r\nодежда.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;mso-ansi-language:EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панель (эквалйзер)&amp;nbsp;\r\nфункционирует по принципу светового индикатора, эквалайзера, т.е. изображение\r\nпульсирует в такт окружающим звукам. Будь то играющая музыка, хлопки или любой\r\nдругой источник звука.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В такой\r\nодежде вы не останетесь, незамеченным ни в одной компании, ни на одной\r\nвечеринке.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;А если вы\r\nбудете использовать наши футболки с &lt;span lang=&quot;EN-US&quot; style=&quot;mso-ansi-language:&amp;#10;EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панелями (эквалайзерами) и &lt;span lang=&quot;EN-US&quot; style=&quot;mso-ansi-language:EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;аксессуарами,\r\nто восхищенное внимание окружающих, гарантировано.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Дизайн &lt;span lang=&quot;EN-US&quot; style=&quot;mso-ansi-language:EN-US&quot;&gt;LED&lt;/span&gt; панели(эквалайзера), предусматривает использование,\r\nкак одного &lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&lt;/span&gt;цвета, так и их комбинацию. Ассортимент\r\nпозволяет выбрать наиболее понравившийся цвет и изображение.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Мы\r\nиспользуем бейсболки глубокого, черного цвета, для достижения максимального\r\nрезультата.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;Источники\r\nпитания – элемент &lt;span lang=&quot;EN-US&quot; style=&quot;mso-ansi-language:EN-US&quot;&gt;LR&lt;/span&gt;\r\n2032 («часовые» батарейки).&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;В отличии от\r\nмоделей предыдущих поколений, где панель пришита к бейсболке, что исключает ее\r\nстирку, новая модель предусматривает компактный блок, который крепится, с\r\nпомощью застежек «липучка».&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;При стирке\r\nон легко отсоединяется и так же присоединяется.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;mso-ansi-language:EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;панель (эквалайзер)&amp;nbsp;\r\nпредставляет собой полноценное электронное устройство, которое помимо &lt;span lang=&quot;EN-US&quot; style=&quot;mso-ansi-language:EN-US&quot;&gt;LED&lt;/span&gt;&lt;span lang=&quot;EN-US&quot;&gt; &lt;/span&gt;дисплея,\r\nвключает в себя блок управления, имеющий датчики замера окружающих звуков.&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:0cm;margin-bottom:.0001pt&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n', 'Эквалайзер,бейсболка,клубная,LED', 'Бейсболка эквалайзер детская', 'Бейсболка эквалайзер детская. Акция. 890рублей.', 'Эквалайзер. Бейсболка. Детская. Акция.');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('315', '1', 'Светящиеся шнурки', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 14px; line-height: 20px;&quot;&gt;Светящиеся шнурки - незаменимый атрибут современного тусовщика.&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 14px; line-height: 20px;&quot;&gt;Идеальны&amp;nbsp;для вечеринок.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 14px; line-height: 20px;&quot;&gt;Сделаны из специального гибкого пластика, с встроенными лед источниками света и блоком управления, закрепляемом на «язычке» обуви.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 14px; line-height: 20px;&quot;&gt;Доступен режим непрерывного свечения и мерцания. Переливаются разными цветами.&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 0.0001pt; font-size: 14px; line-height: 20px;&quot;&gt;Длина: 80см&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;Светящиеся шнурки используют источники питания – 2 элемента&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;LR&lt;/span&gt;&lt;span style=&quot;font-size: 14px; line-height: 20px;&quot;&gt;&amp;nbsp;2032 («часовые» батарейки).&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Светящиеся, шнурки,очки,сережки,браслеты,тусовка', 'Светящиеся шнурки', 'Светящиеся шнурки|Акция|390рублей|Успей купить', 'Светящиеся, шнурки,очки,сережки,браслеты,тусовка');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('199', '1', 'Внешний аккумулятор для телефона ( power bank) 2600 mAh,алюминий', '&lt;p&gt;Внешний аккумулятор (Power bank)&amp;nbsp;поможет реанимировать ваш телефон , если его батарея неожиданно &quot;села&quot;. Легкий и компактный он поместиться в кармане или дамской сумочке. Корпус сделан из анодированного алюминия разных расцветок. С помощью соответствующего USB кабеля, внешний аккумулятор может зарядить, не только любой телефон или смартфон, но и&amp;nbsp;&amp;nbsp;другое устройство заряжаемое от сети, как то планшет, фотоаппарат, игровая приставка и.т.д.&lt;/p&gt;&lt;p&gt;Внешний аккумулятор ( Power bank ) ваш незаменимый помощник.&lt;br&gt;&lt;/p&gt;', 'Power bank,Внешний, аккумулятор,iPhone, samsung ', 'Внешний аккумулятор для телефона ( power bank)', 'Внешний аккумулятор для телефона ( power bank)|Акция|490рублей', 'Внешний аккумулятор, power bank, iPhone, samsung,');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('172', '1', 'Закаленное стекло c эффектом 2,5D для  Samsung Galaxy Note4', '&lt;p&gt;Защитное, закаленное, сверх- прочное&amp;nbsp;стекло надежно защитит экран вашего смартфона от повреждений, царапин и потертостей. Толщина &amp;nbsp;стекла всего - 0,3мм, при этом за счет закаливания, оно имеет высокие прочностные характеристики. Специальная технология, используемая при изготовлении, позволила создать эффект трех-мерности&amp;nbsp; на дисплее. &amp;nbsp;Края стекла специально закруглены для удобства использования. &amp;nbsp;Стекло легко крепится на дисплей телефона. На многих современных телефонах замена стекла дисплея автоматически влечет замену самого дисплея. Потратив несколько сотен рублей на защитное стекло, можно сэкономить&amp;nbsp; несколько тысяч на дорогостоящем ремонте, который выведет из строя ваш телефон на несколько дней, а то и недель.&lt;/p&gt;&lt;p&gt;Подробная инструкция по установке защитного стекла&amp;nbsp;напечатана на упаковке товара. В комплекте идут специальные приспособления для удаления пылинок, при наклейки, спиртовая салфетка и салфетка для финальной очистки дисплея. В отличии от защитной пленки, наклеить защитное стекло намного проще. Т.к. поверхность защитного стекла гораздо тверже, воздух между экраном и стеклом выдавливается под его весом и не образует &quot;пузырьков&quot; при наклеивании.&lt;/p&gt;', 'Защитное,закаленное,стекло,сверх-,прочное,2,5D', 'Защитное закаленное стекло ', 'Защитное, закаленное, сверх-прочное стекло с эффектом 2,5D. Низкие цены.', 'Защита, закаленное, для смартфона, сверх-, прочное. ');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('171', '1', 'Закаленное стекло c эффектом 2,5D для  Samsung Galaxy Note3', '&lt;p&gt;Защитное, закаленное, сверх- прочное&amp;nbsp;стекло надежно защитит экран вашего смартфона от повреждений, царапин и потертостей. Толщина &amp;nbsp;стекла всего - 0,3мм, при этом за счет закаливания, оно имеет высокие прочностные характеристики. Специальная технология, используемая при изготовлении, позволила создать эффект трех-мерности&amp;nbsp; на дисплее. &amp;nbsp;Края стекла специально закруглены для удобства использования. &amp;nbsp;Стекло легко крепится на дисплей телефона. На многих современных телефонах замена стекла дисплея автоматически влечет замену самого дисплея. Потратив несколько сотен рублей на защитное стекло, можно сэкономить&amp;nbsp; несколько тысяч на дорогостоящем ремонте, который выведет из строя ваш телефон на несколько дней, а то и недель.&lt;/p&gt;&lt;p&gt;Подробная инструкция по установке защитного стекла&amp;nbsp;напечатана на упаковке товара. В комплекте идут специальные приспособления для удаления пылинок, при наклейки, спиртовая салфетка и салфетка для финальной очистки дисплея. В отличии от защитной пленки, наклеить защитное стекло намного проще. Т.к. поверхность защитного стекла гораздо тверже, воздух между экраном и стеклом выдавливается под его весом и не образует &quot;пузырьков&quot; при наклеивании.&lt;/p&gt;', 'Защитное,закаленное,стекло,сверх-,прочное,2,5D', 'Защитное закаленное стекло ', 'Защитное, закаленное, сверх-прочное стекло с эффектом 2,5D. Низкие цены.', 'Защита, закаленное, для смартфона, сверх-, прочное. ');
