INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('205', '1', 'Внешний аккумулятор для телефона ( power bank) ,5200 mAh,алюминий', '&lt;p&gt;Внешний аккумулятор (Power bank)&amp;nbsp;поможет реанимировать ваш телефон , если его батарея неожиданно &quot;села&quot;. Легкий и компактный он поместиться в кармане или дамской сумочке. Корпус сделан из анодированного алюминия разных расцветок. С помощью соответствующего USB кабеля, внешний аккумулятор может зарядить, не только любой телефон или смартфон, но и&amp;nbsp;&amp;nbsp;другое устройство заряжаемое от сети, как то планшет, фотоаппарат, игровая приставка и.т.д.&lt;/p&gt;&lt;p&gt;Внешний аккумулятор ( Power bank ) ваш незаменимый помощник.&lt;/p&gt;', 'Power bank,Внешний, аккумулятор,iPhone, samsung ', 'Внешний аккумулятор для телефона ( power bank)', 'Внешний аккумулятор для телефона ( power bank)|Акция|990рублей', 'Внешний аккумулятор, power bank, iPhone, samsung,');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('203', '1', 'Внешний аккумулятор для смартфона,Power Bank,16000 mAh,алюминий', '&lt;p&gt;Внешний аккумулятор поможет реанимировать ваш телефон , если его батарея неожиданно &quot;села&quot;. Легкий и компактный он поместиться в кармане или дамской сумочке. Корпус сделан из анодированного алюминия, разных расцветок. С помощью соответствующего USB кабеля, внешний аккумулятор может зарядить, не только телефон, но и &amp;nbsp;любое другое устройство заряжаемое от сети.&amp;nbsp;&lt;br&gt;&lt;/p&gt;', 'Power bank,Внешний, аккумулятор,iPhone, samsung ', 'Внешний аккумулятор для телефона ( power bank)', 'Внешний аккумулятор для телефона ( power bank)', 'Внешний аккумулятор, power bank, iPhone, samsung,');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('216', '1', 'USB кабель для зарядки телефона и передачи данных (smile face), разъем micro USB', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель smile face выполнен в виде плоской ленты и имеет&amp;nbsp;встроенные светодиодные индикаторы, которые мерцают при подключении кабеля к зарядному устройству.&amp;nbsp; Представлена широкая цветовая гамма. Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем microUSB. &lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона', 'USB кабели для любых телефонов|необычный дизайн|приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('220', '1', 'USB кабель - браслет для зарядки телефона и передачи данных, разъем micro USB', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp; &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем microUSB. Представлена широкая цветовая гамма.&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель - браслет для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('184', '1', 'USB кабель для зарядки телефона и передачи данных, плетенный, светящийся, разъем micro USB', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;имеет плетенную оплетку из нейлона, что позволяет использовать его длительное время, не боясь&amp;nbsp;&quot;заломов&quot;, а так же&amp;nbsp;встроенные светодиодные индикаторы, которые мерцают при подключении кабеля к зарядному устройству.&amp;nbsp; Представлена широкая цветовая гамма. &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем micro USB. &lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('217', '1', 'USB кабель для зарядки телефона и передачи данных (детский дизайн), разъем micro USB', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp; выполнен в виде&amp;nbsp;голов различных животных, что безусловно понравится вашему ребенку, он так же имеет встроенные светодиодные индикаторы, которые мерцают при подключении кабеля к зарядному устройству.&amp;nbsp; &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем microUSB.&amp;nbsp; &lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('189', '1', 'USB кабель для зарядки телефона и передачи данных, в виде ключа, разъем micro USB', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp; выполнен в оригинальном форм-факторе - ключа, что конечно не останется без внимания окружающих. При этом&amp;nbsp;компактный размер, данной модели,&amp;nbsp;позволяет экономить место в кармане или сумочке&amp;nbsp;. Представлена широкая цветовая гамма. &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем microUSB.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('187', '1', 'USB кабель для зарядки телефона и передачи данных, светящийся (STAR LED), разъем micro USB', '&lt;p&gt;USB кабель&amp;nbsp;STAR LED&amp;nbsp;предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель STAR LED&amp;nbsp;имеет встроенные светодиоды, которые позволяют ему,&amp;nbsp;при подключении к источнику питания, равномерно светиться по всей длине.&amp;nbsp; Представлена широкая цветовая гамма: зеленый, желтый, синий и красный цвета. &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем micro USB.&amp;nbsp; &lt;br&gt;&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('213', '1', 'USB кабель для зарядки телефона и передачи данных белый, разъем micro USB', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель имеет стандартный дизайн, что несомненно понравится любителям классических решений.&amp;nbsp;Цвет белый&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем microUSB. &lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('210', '1', 'USB кабель для зарядки телефона и передачи данных 2 в 1, разъемы: для  micro USB и для Iphone 5-6', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель2&amp;nbsp;в 1&amp;nbsp;выполнен в виде плоской ленты и имеет подвижный пластиковый корпус, который одновременно является чехлом для кабеля. Несколькими движениями кабель можно свернуть по принципу рулетки, в этот&amp;nbsp;компактный чехол. &amp;nbsp; Представлена широкая цветовая гамма. &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем micro USB, 8pin(IPhone 5-6).&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона 2 в 1', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('209', '1', 'USB кабель для зарядки телефона и передачи данных 4 в 1, разъем micro, mini USB, Iphone 3-4, Iphone 5-6', '&lt;p&gt;USB кабель предназначен для: зарядки телефона / смартфона и передачи данных на компьютер или ноутбук. USB кабель 4&amp;nbsp;в 1 &amp;nbsp;выполнен в&amp;nbsp;компактном форм- факторе, занимающим&amp;nbsp;минимум места&amp;nbsp;. Имеющиеся разъемы позволяют&amp;nbsp;подключать к его к практически любому телефону/смартфону, в т.ч. ко всем аппаратам семейства IPhone, а так же к другим устройствам (некоторым фото- аппаратам, электронным книгам и.т.д.). &amp;nbsp; Представлена широкая цветовая гамма. &lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем micro, mini USB, 30pin (IPhone 3-4), 8pin(IPhone 5-6).&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель для зарядки телефона 4 в 1', 'USB кабели для любых телефонов | необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('182', '1', 'Кабель USB для Iphone 4, плетенный для зарядки телефона и передачи данных, разъем 30(pin)', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 30(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'кабель usb - Iphone4 браслет для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('214', '1', 'USB кабель для зарядки телефона и передачи данных (smile face), разъем 30(pin) для Iphone', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель smile face выполнен в виде плоской ленты и имеет&amp;nbsp;встроенные светодиодные индикаторы, которые мерцают при подключении кабеля к зарядному устройству.&amp;nbsp; Представлена широкая цветовая гамма. Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем microUSB. &lt;i&gt;&lt;/i&gt;&lt;u&gt;&lt;/u&gt;&lt;sub&gt;&lt;/sub&gt;&lt;sup&gt;&lt;/sup&gt;&lt;strike&gt;&lt;/strike&gt;&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель smile  для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('221', '1', 'USB кабель - браслет для зарядки телефона и передачи данных, разъем 8(pin) для Iphone 5-6', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 8(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'кабель браслет айфон 5 для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('190', '1', 'USB кабель Ключ, для iphone 5 для зарядки телефона и передачи данных, разъем 8(pin) для Iphone 5', '&lt;p&gt;USB кабель предназначен для: зарядки телефона /смартфона и передачи данных на компьютер или ноутбук. USB кабель&amp;nbsp;- браслет&amp;nbsp;выполнен в виде браслета и приспособлен для ношения на руке, а в сумке или кармане занимает минимум&amp;nbsp;Небольшая длина позволяет использовать его для зарядки телефона через внешний аккумулятор.&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;br&gt;Все USB кабели проходят двойной контроль качества и подходят ко всем телефонам, имеющим разъем 8(pin). Представлена широкая цветовая гамма.&lt;br&gt;&lt;/p&gt;', 'USB, кабели, телефон, зарядка, прошивочные', 'USB кабель - iphone 5 для зарядки телефона', 'USB кабели для любых телефонов| необычный дизайн | приятные цены', 'USB, кабели, телефон, зарядка, прошивочные');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('179', '1', 'Защитное тонированное закаленное стекло черное для Iphone 5', '&lt;p&gt;Защитное, тонированное, закаленное, сверх- прочное&amp;nbsp;стекло надежно защитит экран вашего смартфона от повреждений, царапин и потертостей. Толщина &amp;nbsp;стекла всего - 0,3мм, при этом за счет закаливания, оно имеет высокие прочностные характеристики. Специальная технология, используемая при изготовлении, позволила создать эффект трех-мерности&amp;nbsp; на дисплее. &amp;nbsp;Края стекла специально закруглены для удобства использования. &amp;nbsp;Стекло легко крепится на дисплей телефона. На многих современных телефонах замена стекла дисплея автоматически влечет замену самого дисплея. Потратив несколько сотен рублей на защитное стекло, можно сэкономить&amp;nbsp; несколько тысяч на дорогостоящем ремонте, который выведет из строя ваш телефон на несколько дней, а то и недель.&lt;/p&gt;&lt;p&gt;Подробная инструкция по установке защитного стекла&amp;nbsp;напечатана на упаковке товара. В комплекте идут специальные приспособления для удаления пылинок, при наклейки, спиртовая салфетка и салфетка для финальной очистки дисплея. В отличии от защитной пленки, наклеить защитное стекло намного проще. Т.к. поверхность защитного стекла гораздо тверже, воздух между экраном и стеклом выдавливается под его весом и не образует &quot;пузырьков&quot; при наклеивании. Защитное тонированное стекло - лучшая защита для вашего дисплея и вашей информации.&lt;/p&gt;', 'Защита, закаленное, тонированное, для телефона, сверх-, прочное, 2,5D', 'Защитное тонированное закаленное стекло ', 'Защитное, тонированное, стекло|Эффект 2,5D|Низкие цены.', 'Защита, закаленное, тонированное, для телефона, сверх-, прочное, 2,5D');
